INSERT INTO `activities` (`ID`, `TITLE_`, `BRIEF_`, `DET_PATH`, `PICTURE_PATH`, `DATE_OF_ACTIVITY`, `DATE_`, `STATUS_`, `USERNAME_`) VALUES
(3, 'Rashtriya Ekta Diwas', 'AIHM instilled the thought of discipline by pledging in the presence of the esteemed Dean Academics to always remember that “WORK IS GOD’. This came as a ‘National Ekta Day’ event in remembrance of the great Sardar Vallabh Bhai Patel, ‘The Iron Man Of India’. ‘We create the path you follow through deeds and actions’.', '3.pdf', '3.jpg', '2017-10-31', '2017-12-09 16:59:13', 0, 'diraihm'),
(4, 'FUSION WORKSHOP', 'A creative offering of Food Production was venturing the’ world of appetizing l’ through creativity. The zenith of performance was acknowledged by Amar Ujala team that witnessed the fusion of Uttrakhand and Italian dishes at the well structured Hotel Management Department of Amrapali. \r\nA star of reality is our motto and we strive to stand on it’. \r\nHurray!!!  The pictures reveal the success. \r\nTake a walk....... down the gallery.', '4.pdf', '4.jpg', '2017-11-10', '2017-12-09 18:05:17', 0, 'diraihm'),
(5, 'TOURISM DAY', 'The dynamic nature of life never leaves anyone untouched. We at AIHM have tried to mould students through talent hunt. The national Tourism day saw the collage making hands as a collaborated group activity when the theme of ‘Sustainable Tourism’ went onboard as a competitive zeal. \r\nYes! laurels did come to three groups. \r\nDo check out through the pics ……..', '5.pdf', '5.jpg', '2017-09-27', '2017-12-09 18:11:44', 0, 'diraihm'),
(6, 'FESTIVE BLISS TO AIHM', 'India is a land of festivals and hospitality is a platform of creativity. The housekeeping department gave intelligent ideas to its students to decorate the arrival of ‘Purushotham Ram’ through beautiful decoration at the lobby and the Main Hall zone at AIHM. Sparkling decoration and skill enlightened every spirit for Deepawali Celebration.', '6.pdf', '6.jpg', '2017-10-18', '2017-12-09 18:13:17', 0, 'diraihm'),
(7, 'CAKE MIXING 2017', 'This December too saw the gathering of different departments of AGI under one platform for mixing the delicacies of life into ingredients of love and compassion as the esteemed management along with various mentors and students gathered to involve themselves in the ceremonious cake mixing ceremony.', '7.docx', '7.jpg', '2017-12-01', '2018-01-18 16:50:15', 0, 'diraihm'),
(8, 'Christmas and New Year ', 'The Amrapali institute of Hotel Management shares an extravaganza of activities through the various festivals acknowledge worldwide. The ‘fare de well’ of 2017 was with an artistically colorful touch to celebrate the return of ‘Lord Ram ’ during ‘Deepawali’ and the reminder of the welcome to ‘Lord Jesus’ into the celestial world during ‘Christmas’. A wonderful onset of winters saw the wonders of art reflected through the decorations during these festivals. ', '8.docx', '8.jpg', '2018-01-01', '2018-01-20 21:59:28', 0, 'diraihm'),
(9, '\'Management Games\' ', '\'Management Games\'  will be organized by Faculty of Commerce & Business Management on Feb 15th 2018 .\r\n\r\n', 'x', '9.jpg', '2018-02-15', '2018-02-13 11:08:44', 1, 'dirmba'),
(10, 'ABHYUDAYA 2018', 'Abhyudaya 2018 came forth as a package of competition, education and enthusiasm with twenty three teams from various Hotel Management Institutes across the country competing to showcase their best. The two days event on 20th and 21st February envisaged a multitude of activities like Regional and International Culinary competition, Patisseries and Confectionary Competition, Heat less cooking, Flower and pot decoration competition, Dress the cake, At Your Service, Bartending competition, On Pins and Needle and Adhyan competitions. Abhyudaya had glamour, thrill and sportsmen spirit and interested one and all. The competition means a lot to the enthusiasts as talent speaks voluminously through participation. ', '10.docx', '10.JPG', '2018-02-21', '2018-02-22 11:09:45', 0, 'diraihm'),
(11, 'INDUSTRIAL VISIT', 'An all round sustainable development of students’ requires the connection between corporate and campus. Keeping this in mind, AIHM organized industrial visit for its first year students from 12th to 20th March, 2018.The visit owes its gratitude to The Taj Gateway, Ramnagar, Dhikuli, Uttrakhand. It was a day’s activity and a fun-filled learning process through observation in the real professional environment. The students visited all the core functional areas of the Hotel and observed the order of management. It was an experience based learning program beyond the conventional college model and a rejuvenating experience to the first year students.', 'x', '11.png', '2018-03-21', '2018-04-18 10:40:33', 0, 'diraihm'),
(12, 'SKILL INDIA-2018', 'Skill India, the most promising talent hunt and enhancement program by the esteemed Prime Minister of India is now extending everywhere even in the remote areas of Uttrakhand. Amrapali Institute of Hotel Management, Haldwani, known for enhancing the skills of the common masses of Uttrakhand has been chosen as a welcome platform to showcase skills in the Kumaun region of Uttrakhand. The event acknowledged the skills of students in the F& B services as well as the Food Production. It served both as a platform to show the skills and to encourage the students to further chisel their existing skills. The event was held under the guidance of the skilled faculty of Amrapali Institute of Hotel Management as well as the acknowledged judges Mr. Seeresh Saxena from Indian Culinary Forms, New Delhi, Mr. Mahendra Khairiya from Sarovar Group of Hotels, Delhi- NCR and Mr. Tahir Sufi, HOD Graphic Era University, Dehradun along with Mr. R.C Pande Principal GIHM Dehradun, Mr. Rahal Vasudev an intellectual and expert in F&B services and Mr. Achintan Teroz Caroli an expert in F&B services.', '12.docx', '12.png', '2018-04-12', '2018-04-19 04:32:03', 0, 'diraihm'),
(13, 'INDUSTRIAL VISIT (FCSA)', 'FCSA organised an Industrial Visit for the final year students of BCA. The objective of the visit was to provide students with an opportunity to explore the professional culture and working environment within an multinational corporation (MNC). It was a day\'s tour to Delta Power Solutions, located at  SIDCUL Industrial Area, Rudrapur (Uttarakhand). It is a Taiwan based organisation providing uninterrupted power solutions , data center infrastructure solutions, telecom power solutions, etc. It was a good learning experience to the students as the work space was totally pollution free with green culture, based on solar power consumption. Students got an opportunity to visit all the functional units within the organisation, having an insight of all the details. It was a motivating learning experience for all the students to strive their professional careers.', 'x', '13.jpg', '2018-04-13', '2018-04-19 06:55:56', 1, 'DIRMCA'),
(14, 'Skill India, second level', 'And one stage leads to other but winners never give up!!!\r\n\r\nThe second level of skill India competition at Graphic Era Dehradun has brought immense joy to the management, staff and students of AIHM, Haldwani as the talented students have come home with laurels. The state level skill testing competition initiated by the Government of India under the auspices of Mr. Modi has helped to recognize the diamonds of Amrapali Group of Institutes who marched out with flights of aspiration and marched in with their head held high. ', '14.docx', '14.jpg', '2018-04-21', '2018-04-21 05:17:08', 0, 'dirAIHM'),
(15, 'Building Awareness on IPR', 'One day workshop on “Building Awareness on Intellectual Property Rights” was organised by faculty of Computer Science & Applications (AGI) with an association and sponsorship by Uttarakhand State Council of Science & Technology (UCOST), Dept of Science & Technology, (Government of India) on 20th April, 2018. Dr. Anju Rawat, (Scientist-B, UCOST) covered the concept and basic knowledge about IPR i.e. Patent, Trademark, GI & Designs, Layout Designs etc. : Mr. Himanshu Goel (Project Scientist, UCOST) covered the concept of patenting system in India & role of Patent Information Center (PIC) in Uttarakhand. Ms. Swatee Rawat (Scientific Trainee, TIFAC, UCOST)\r\nfocused on the importance of copyright and copyright system in India. Ms. Kamika Chaudhary (Scientific Trainee, TIFAC, UCOST)\r\ngave a session on Trademark and Industrial design. ', '15.docx', '15.jpg', '2018-04-20', '2018-04-26 03:42:05', 1, 'DIRMCA'),
(16, 'Hybrid Apps Development', 'A day‘s workshop was organised by Faculty of Computer Science & Applications (AGI), on “Hybrid Application Development” for the students of BCA and B.Sc. (CS/IT) from other Universities, Institutes and Colleges. More than 100 students from 16 different Institutes and colleges such as, Jai Arihant Institute (Haldwani), Pal College (Haldwani), DSB campus (Nainital), SIMT (Kashipur), IMT (Kashipur), VCMT (Gaulapaar), SSJ Campus (Almorah) etc. were present in the workshop. Dr. Nitin Deepak, Dr. Naveen Tewari and Mr. Mukesh Joshi lead the technical sessions imparting the knowledge to develop and publish hybrid mobile applications with the help of NoSQL, MongoDB, Bootstrap, PhoneGap framework and GitHub technologies. ', '16.docx', '16.JPG', '2018-04-21', '2018-04-26 03:59:52', 1, 'DIRMCA'),
(17, 'Industrail Visit -1 (FCBM)', 'Industrial visits are an effort to bridge the gap between classroom learning and practical exposure.\r\nTo help students gain first-hand information regarding functioning of the industry, MBA 2nd semester students of Faculty of Commerce & Business Management were taken on an industrial visit to \"PREETI INDUSTRIES”, Lamachaur on Tuesday, 13th of March. Preeti Industries is a small company which produces non-woven polybags. The students were accompanied by Dr Garima Jaiswal Chandra &\r\nMs. Farah Naeem.', '17.pdf', '17.PNG', '2018-03-13', '2018-06-04 08:05:07', 1, 'nitin'),
(18, 'Industrail Visit - 2 (FCBM)', 'Industrial visits are a value-added learning method for management students. Learning from textbooks, lectures and other study material does not suffice for holistic learning. Practical, hands-on learning is essential for better understanding of work processes and business functions.<br>\r\nSo, to give students a practical exposure, an industrial visit to Parle Agro Pvt Ltd, SIDCUL, Pantnagar was organised for BBA I year students by FCBM, Amrapali Group of Institutes.\r\n', '18.pdf', '18.PNG', '2018-03-20', '2018-06-04 08:09:03', 1, 'nitin'),
(19, 'Industrial Visit - 3 (FCBM)', 'Industrial visits provides an opportunity to plan, organise and engage students in active learning experiences both inside and outside the classrooms and gives an insight into the real working environment of the industry. This not only help students to understand the do’s and don’ts of the industries, but also helps them to see their future place in the industry.<br>\r\nSo these visits are an effort to bridge the gap between classroom learning and practical exposure.To help students gain ', '19.pdf', '19.PNG', '2018-03-27', '2018-06-04 08:11:44', 1, 'nitin'),
(21, 'HM Orientation 2018', 'Hotel Management Orientation Program 2018\r\n‘An eye for detail\r\nA warmth of greetings\r\nA welcome smile and a determination to rise…’\r\nWith these thoughts Amrapali Institute of Hotel Management welcomed the new fresh faces planning to be future hoteliers in its beautiful premises. The orientation program extended from 1st August to 11th August to introduce the fresh faces to the premises, its rules and regulation and curriculum and professional needs. ', '21.docx', '21.JPG', '2018-08-01', '2018-08-18 11:01:25', 0, 'dirAIHM'),
(22, 'Alumni Meet 2018', 'The Alumni Meet 2018 went as a gala event of celebrations at the Amrapali Institute of Hotel Management welcoming all its old students. A month long preparation and untold excitement could be seen across the entire AIHM. The Alumni gathered at the AIHM Hall on the 25th of August to meet their beloved teachers and old friends. ', '22.docx', '22.jpg', '2018-08-25', '2018-08-27 10:56:43', 0, 'dirAIHM'),
(23, 'Teacher’s day 2018', 'Teacher’s day was celebrated in Amrapali Institute of Hotel Management, Haldwani by the illustrious students as a token of love to their respected teachers. The day was a fun filled one with students performing to the happiness of the teachers.', '23.docx', '23.jpg', '2018-09-05', '2018-09-18 05:35:47', 0, 'dirAIHM'),
(24, 'SpicMacay @ Amrapali', 'SpicMacay and Amrapali Group of Organization , jointly orgainized Odissi Dance Concert of\r\nPadmashree Ranjana Gauhar ji , along with Vinod Kevin Charan and Vrinda Chaddha , They performerd on Mangalacharan with Shiv Stuti , Padmashree Ranjana Gauhar ji inforimed the studnets about the rich history of Odissi , A very Beatuiful NartyaNatika based on Jaidev \"Geet Govind \" perfoemded by Ranjna ji.', 'x', '24.jpg', '2018-09-04', '2018-09-20 07:04:27', 1, 'nitin'),
(26, 'World Tourism Day 2018', 'The World Tourism day 27th Sept., 2018 was fêted in Amrapali Institute of Hotel Management. ‘Charity begins at home’ and the Institute attempted to make this event dwell in the heart of the students by imbibing the cultural values of Uttrakhand through the much sort after Uttrakhand Cuisine preparing in-house completion.', '26.docx', '26.JPG', '2018-09-27', '2018-10-03 07:00:34', 1, 'nitin'),
(27, 'Rising Stars at Dehradun', 'The students of AIHM, Haldwani, once again prove their efficiency by out sparkling with peak positions in the Hospitality Rising Star Inter College competition held at Graphic Era University, Dehradun on World Tourism Day. There were five activities held to encourage students to perform to their best capabilities where Deepak Mehra obtained the first Quiz Up position. In the Speak Out round Amit Kala was the best speaker. Pradeep Bisht and Akarshit Bisht proved themselves in Bartending and fire flaring with first position and Rohit Shah came first in the Miniature Gardening Competition.  The first position in culinary competition was obtained by Rohit Joshi and Daleep Singh. The spirit to compete and come out with flying colors dwells in every heart of Amrapali Group of Institutes.', 'x', '27.jpg', '2018-09-28', '2018-10-09 06:56:21', 1, 'dirAIHM'),
(28, 'Diwali Decoration 2018', 'Diwali the festival of lights was celebrated with gaiety and joviality at AIHM, Haldwani. The housekeeping department with artistic hands and creative minds snapped the show with its ingenious decorations.', '28.docx', '28.jpg', '2018-11-07', '2018-11-21 06:52:15', 0, 'dirAIHM'),
(29, 'Cake mixing X mas', 'PRE CHRISTMAS MIXING: A LOVELY TRADITION \r\nENGRAVING A STORY TO CLOSE 2018 WITH WARMTH\r\nWalking down the elegant corridor dwells at one energetic corner, the heart of the professional chefs of Amrapali Institute of Hotel Management that has destined thousands of skills. This is none other than the ground floor Training ‘Restaurant’ formally dressed in the elegance of the wooden worktable and positioning its decorum with a beautiful array of dishes, glasses, side plates and corner decorations, a style of AIHM alone.', '29.docx', '29.jpg', '2018-11-27', '2018-11-29 07:10:24', 0, 'dirAIHM'),
(30, 'Avahan 2019', '‘QUEST IS THE ESSENCE OF MANKIND’\r\n The 6th International Conference on ‘Preparing Education for the Effects of the 4th Industrial Revolution on Hospitality and Tourism’ was a two day event scheduled at Amrapali Institute of Hotel Management, Haldwani on 22nd and 23rd January, 2019. \r\n', '30.docx', '30.JPG', '2019-02-02', '2019-02-11 05:42:25', 1, 'dirAIHM'),
(31, 'Abhyudaya-2019', 'The talent to be able to rise to achieve prosperity, good fortune, elevation and success can build any bond and when it comes to Teacher- Student Bond the word ABHYUDAYA sounds just true to its meaning. ', '31.docx', '31.jpg', '2019-02-23', '2019-03-05 09:10:31', 1, 'dirAIHM'),
(32, 'Cloud Computing Workshop', 'Faculty of Technology &amp; Sciences, AGI hosted one day workshop on \"Cloud Computing and the virtual world\" successfully on 11-Mar-2019. The workshop witnessed the participation of more than 150 MCA, BCA, B.Tech. (CSE), Diploma (CSE), Diploma (IT) courses students from various colleges. <br>Prof. Pramod Joshi, the resource person for the workshop discussed the various aspects of cloud computing and virtualization.', 'x', '32.jpg', '2019-03-11', '2019-03-12 04:57:21', 1, 'nitin'),
(33, 'HOLI DARBAR 2019', 'It is a spectacular watch of colorful departmental integration with Abeer – Gulal aloft, the traditional colors and cultural dance below immersing teachers and students in a melodious motion worth describing as this is the way Amrapali Group of Institutes keeps Indian Heritage alive. Yes, we are taking of the event that swipes away monotony and boredom of routine life; HOLI. \r\nThe Dwadashi of PHAGUN month of VIKRAM SAMVAT saw Amrapali Family in faction with a beautiful Holi niche designed as a DARBAR in one of the most beautifully maintained natural gardens adjacent to its main building. Once again the entire family was welcomed with holy teeka to celebrate and re-instigate the bond of love demonstrating motion in concentric circles to the beat of percussion and traditional instruments, displaying the Uttarakhand style of Holi Celebration.\r\n', 'x', '33.jpg', '2019-03-21', '2019-03-22 06:50:55', 1, 'dirAIHM'),
(34, 'Farewell to HM students', 'Farewell 2019\r\nADIOS AMIGOS \r\nGoodbye, Hope you do the best IN LIFE ……….. FAREWELL!\r\nThe AIHM seminar hall accumulating memories of the past came to a jubilant mood with wishes, ‘May You Fare Well in Your Life.’ A gathering of teachers, juniors and seniors marked with the awe inspiring presence of the Management in an emotional atmosphere was attuned with the bidding Goodbye to the senior students of Amrapali Institute of Hotel Management. The juniors made all attempts to help the outgoing students relive the memories of the past. This was an occasion marked with the ceremonious lamp lightning, followed by tree planting event completed by the outgoing students. ‘As we sow shall we reap and share our presence in the world.’ \r\n', '34.docx', '34.jpg', '2019-05-22', '2019-05-25 07:00:07', 1, 'dirAIHM'),
(35, 'TREE PLANTATION', 'Hope is the next generation and a wishful entity to continue the human journey successively on the earth. With the tree planting drive initiated by the responsible citizens of the country, the Amrapali Group of Institutes, Haldwani, thoughtfully came forward to plant saplings. ', '35.docx', '35.jpg', '2019-07-13', '2019-07-15 11:01:42', 1, 'dirAIHM'),
(36, 'Orientation 2019', 'The goal of college is to immerse students’ in the college life and AIHM stands to it. The odd fall semester 2019 took a kick start with the guidance offered to the students through orientation 2019. It incorporated sharing of Integrity and varsity for purpose and this purpose ranged from knowing the campus, bonding with birds of the same feather, engaging in club activities, knowing the daily chores, academic and non academic activities. ', 'x', '36.jpg', '2019-08-02', '2019-09-11 06:25:53', 1, 'dirAIHM'),
(37, 'Alumni Meet 2019', '21st Sept. 2019 was a special day at AIHM when the Ex Amrapalians’, who are now soaring high in the professional world, came back to their nests to refresh their memories of the days when their endeavours were just an inward light. The meet started with the cake cutting ceremony followed by a welcome speech followed by a scrumptious lunch.', '37.docx', '37.jpg', '2019-09-21', '2019-10-01 09:43:33', 1, 'dirAIHM'),
(38, 'Introducing new product', 'The management club activity held at FCBM, AGI, was intended to view the passion, exuberance, creativity & management skills of the management students. The participants introduced their ideas by creating products and services under a superficial brand, showing foresightedness as future managers.', '38.docx', '38.jpg', '2019-09-23', '2019-10-22 05:57:07', 1, 'dirmba'),
(39, 'DIWALI CELEBRATION', 'Amrapali Institute of Hotel Management celebrates the decorative festival Diwali through the traditional Rangoli, in the presence of the omnipresent Ganpati and Lakshmi ji idols mingled with some newness to develop creativity. ', '39.pdf', '39.jpg', '2019-10-24', '2019-12-02 03:52:22', 1, 'nitin'),
(40, 'CHEF DAY AT AIHM', 'International Chef Day is celebrated every year to remember the professionals that build a team of efficiency not just to satisfy hunger but to justify the taste buds too. ', '40.pdf', '40.jpg', '2019-10-20', '2019-12-02 03:55:36', 1, 'nitin'),
(41, 'WORKSHOP ON E-WASTE', 'Amrapali Institute of Technology & Sciences and Vincular Testing Labs India Pvt Ltd jointly organized a Workshop on E- Waste Management on 22nd November 2019.\r\nExperts from Vincular Testing Labs Mr. Neeraj Verma and Mr. Shubham Dwivedi (also an Amrapali Alumnus) discussed the various environmental and human issues related to E Waste. \r\n', '41.docx', '41.png', '2019-11-22', '2019-12-17 07:04:44', 1, 'nitin'),
(42, 'Recreational Cum Educational', 'The Students of Computer Science & Engineering Department went on a Educational cum Recreational Trip to Jaipur between 12th and 16th October 2019. The students visited Dotsquares Pvt. Ltd., a CMMI Level 3 Certified Company, in Jaipur. The students attended a session on Project Management at Dotsquares Pvt. Ltd. The students were also informed about the Internship and Employment Opportunities at Dotsquares.', '42.docx', '42.png', '2019-10-12', '2019-12-17 07:09:20', 1, 'nitin'),
(43, 'WORKSHOP ON IOT WITH PYTHON', 'Faculty of Technology and Computer Applications, Amrapali Group of Institutes organised a One Day Workshop on \"Internet of Things (IOT) with Python\" today on 14th September 2019.\r\nThe Workshop started with the Lamp Lighting Ceremony followed by the Welcome Address by Prof (Dr.) Manoj Pandey, Director wherein he discussed the latest trends and developments in the Computing World. Dr. Sanjay Dhingra, CEO interacted with the students and congratulated the Faculty Members for their initiative of organising the workshop. He asserted that the Institute should organise similar workshops in the future too.\r\n', '43.docx', '43.png', '2019-09-14', '2019-12-17 07:12:30', 1, 'nitin'),
(44, 'ORIENTATION PROGRAMME', 'Newly admitted B. Tech, B. Sc. (Hons.) and Polytechnic Diploma students were warmly welcomed by the faculty members and the students of Amrapali Institute of Technology and Sciences. A Week long Orientation Programme was hosted from 20th to 25 August 2019 to familiarize the freshers with the various Academic,Co Curricular and Extra Currilcular Activities of the Institute.', '44.docx', '44.png', '2019-08-20', '2019-12-17 07:15:45', 1, 'nitin'),
(45, 'Credit Research Challenge 20', 'FCBM students of MBA- 1st Year and MBA 2nd year are participating in the 3rd National Competition - Credit Research Challenge 2020 organized  by AIWMI..', '45.jpg', '45.jpg', '2020-01-19', '2019-12-24 07:00:56', 1, 'dirmba'),
(46, 'THE 71ST REPUBLIC DAY', 'On 26th January, 2020, Amrapali Group of Institutes gathered at its Main Building Garden to begin the New Year Celebrations and events with Republic Day. The dignitaries were the Management Mrs. Bindu Chawla and the Chief Guest Colonel R C Bhandari (Retd.) who unfurled the Tricolour. The National song was sung by B ed. Students in the presence of the faculty and students and staff members.', '46.docx', '46.jpg', '2020-01-26', '2020-02-12 09:48:55', 1, 'dirAIHM'),
(47, 'Project Fest', 'Diploma Mechanical Engineering, the students of AITS had participated in polytechnic project fest 2019 for Uttarakhand organized by SCE Dehradun and won best project award', 'x', '47.jpg', '2019-10-23', '2020-02-15 10:51:09', 0, 'nitin'),
(48, 'UPES RISE 2019', 'ME diploma student of AITS participated in UPES RIES is 2019 are organized by University of petroleum and energy studies dehradun and stud at 4th position and 53 displayed of VTEC and mtac with only one diploma project.', 'x', '48.JPG', '2019-04-26', '2020-02-15 10:58:02', 1, 'nitin'),
(49, 'SHIVA FEST 2019', 'B Tech mechanical engineering student of AITS participated in shiva fest 2019 and won 2<sup>nd</sup> prize in Auto-CAD designing competition.', 'x', '49.jpg', '2019-11-12', '2020-02-15 11:00:06', 1, 'nitin'),
(50, 'Guest Lecture', 'It was a pleasure to have Prof. (Dr.) Anesh Kumar Maharaj, University of KwaZulu-Natal, South Africa amongst us on 12th September 2019. Prof. Maharaj discussed the Latest Trends in Mathematics, Statistics and Computer Science with the students.  \r\nThanks with best  Regards,', 'x', '50.jpg', '2019-09-12', '2020-02-15 11:03:02', 1, 'nitin'),
(51, 'Visit to Auto-Expo 2020', 'A Team of Students from Amrapali Institute of Technology and Sciences visited Auto Expo 2020, Greater Noida on 12th February 2020 to learn about the latest innovations in the Automobile Industry.', 'x', '51.jpg', '2020-02-12', '2020-02-15 11:04:52', 1, 'nitin'),
(52, 'National Deworming Day@AIPS', 'The Union Ministry of Health and Family Welfare launched National Deworming program on the occasion of National Deworming Day observed on 10 February. <br>\r\nThis is one of the largest public health programs reaching large number of children during a short period. According to World Health Organization 241 million children between the ages of 1 and 14 years are at risk of parasitic intestinal worms in India, also known as Soil-Transmitted Helminths.', '52.docx', '52.jpg', '2020-02-10', '2020-02-19 05:44:47', 1, 'nitin'),
(53, 'Abhyudaya-2020', 'Amrapali Institute of Hotel Management for the 15th year witnessed contest of exuberant skill on February 18th and 19th, 2020. Once again hopes drove talent towards excellence and leaded to display of skills as never seen before.', '53.docx', '53.JPG', '2020-02-19', '2020-02-22 08:24:14', 1, 'dirAIHM'),
(54, 'WORLD\'S PHARMACIST DAY @AIPS', 'Amrapali Institute of Pharmacy and Sciences celebrated its first World’s Pharmacist Day on 25 September 2019.<br>\r\n \"Safe and effective medicines for all” is the theme of this year’s World Pharmacists Day..<br>\r\nMr. Pawan Pandey  Secretary Pharmacist Union Uttarakhand .,Mr. P.C Joshi , Sanrakshak Pharmacist Association,Uttarakhand ,Mr. J.S Rautela ,Vice President Diploma Pharmacist Association,Uttarakand graced the occasion.', '54.pdf', '54.jpg', '2019-09-25', '2020-03-05 07:48:17', 1, 'nitin'),
(55, 'HOLI DARBAR 2020', 'Holi Darbar is an event organized by the students and faculty of AIHM as a part of the learning through practical applicability. \r\nHoli darbar was decorated in the ‘Retro style’ with posters of olden days to the present day Bollywood actor and actress. Students were clad in the Bollywood style and the music and dance all created an atmosphere suitable to the need of the hour. It encompassed in it an atmosphere of Ranga Rang holi through the coordination of Chef Mohit Arya of AIHM.\r\n', '55.docx', '55.jpg', '2020-03-07', '2020-03-13 09:22:40', 1, 'dirAIHM'),
(56, 'Hospitality learning visit', 'Industrial visits are always an effort to link the gap between classroom learning and practical exposure. They are aimed to impart practical knowledge to help students gain realistic information regarding functioning of the hospitality industry. Students of AIHM were taken on an industrial visit to \"Tarangi resort ”, RAMNAGAR on Tuesday , 25th of February. Tarangi is one of the leading and fastest growing hotel chain.', 'x', '56.jpg', '2020-02-25', '2020-03-16 05:34:34', 1, 'dirAIHM'),
(57, 'Clubs activities at AIHM', 'Fortify positivity and insulate creativity says ‘The Decoration Club-AIHM’.\r\nThe lockdown has come up perhaps with the slogan among members of Decoration Club of ASCAB-AIHM.\r\nThe students of the decoration club at AIHM must have come across the saying that, ‘The brain finds what it is looking for when the intentions are creative.’\r\nThe past fifteen days were amazing company as the members of the decoration club under the leadership of Rohit Shah of BHM KU 6th Sem dug into the intricacies of drawing with Indo Western Culture. It is oft said that the deepest moments of crises bring the best of human knowledge and skills.\r\nThe fortnight began with a good wish from Lord Shiva as a painting by Rahul Pandey wishing happy Shravan month to the members. Anyone could have been carried away to travel with the greenery that reminds of travelling during Shravan month when Rohit Shah exhibited the Trival Warli art on a linen mask as a reminder of the pandemic. Then his adornment of the western gown with Indian art brought up the spirits of all and then started the show of fineness. Rahul Chaudhary went ahead with his welcome posing the Indian western dance through such delicacy that eyes could behold for a lifetime. Fantabulous! Cheered the members as Rahul Pandey presented sparkling and dangling paintings of dresses. Kiran Pandey presented bookmarks and facemarks through madhubani paintings and hand paintings with different dance postures came as a colourful gesture from Anjali Dumka, the girl student coordinator and Jacinta Simon. A silent prayer at heart and a meditative mood was finally set in by Pankaj who presented a conch with Dharma Shloka and Buddha with lotus and Deepak Bhatt sent versus of Guru Granth Sahib in Mandala.\r\nA sip of tea with the COVID around was finally caught by members of the Future and Sharp Club as they created videos and posted in the club.\r\nHobby is the break that really helps to dig the ‘me in me’ and that is what every individual must learn to live life to the fullest. The members of ‘Decoration Club and Future and Sharp Club’ are really becoming more agile and efficient company during the lock down.\r\n', 'x', '57.jpg', '2020-08-11', '2020-08-11 11:38:19', 1, 'dirAIHM'),
(58, 'AUGUST MEANS CREATIVE MONTH', 'AUGUST MEANS ‘INSPIRING REVERANCE OR ADMIRATION’ as AIHM celebrates Janmastami, Rakshabandhan and Independence Day in its own creative style.\r\nReverence and admiration are the words associated with August. Do you know that the month of August was once called Sexlitus meaning 6th and in 8 BC the month was named August after Augustus Caesar, the first Roman Emperor. We may call it coincidence or destiny but August is the month of Reverence and admiration in our institute as in our country.\r\nUTU\r\nAUGUST MEANS ‘INSPIRING REVERANCE OR ADMIRATION’ as AIHM celebrates Janmastami, Rakshabandhan and Independence Day in its own creative style.\r\nReverence and admiration are the words affiliated with August. Do you know that the month of August was earlier called ‘Sexlitus’ meaning 6th and in the 8 BC the month was named August after Augustus Caesar, the first Roman Emperor. We may call it coincidence or destiny but August is the month of Reverence and admiration in our country as well. That the country still holds millions in its heart was seen through its celebration at AIHM as well.\r\nRakshabandhan, the admirable festival of love and compassion to celebrate the brother and sister bond falls in this month and so does the Independence Day. The air is full of love and patriotism wetted with the humid days that call upon the heavens to shower their greetings. \r\nThis year it was a solemn process with the Management and the residents at Amrapali Group of Institutes hoisting the National Flag. \r\nThe students  indulged in creativity,found it an opportunity to create and recreate. The students of the Decoration Club symbolically sketched their love through drawings and posters of the National Flag and the emblems of the country. An extra mile effort was demonstrated by Rahul Chaudhary with the slogan ‘Mera Bharat Mahan’ along with Jacinta Simon, Kiran Pandey, Deepak Bhatt and Rahul Pandey while Rohit Sah went to create a short video on the same creating patterns that represent the motherland and its pride. The goose bumps that many experience during the National Song can be felt through the efforts of these young creative and determined hearts that celebrated the nation’s independence through their creativity.\r\nThe students of the Decoration Club also organized a club activity inspiring each other to prepare Rakhi at home. The displays were very professional and the products revealed passion at its zenith. Rohit Kumar Sah of HM  7th Sem, Pankaj Faritiyal of  HM 3rd Year, Anjali Dumka, Jacinta Simon and Rahul Pandey  of HM 2nd Year, Kiran Pandey of BHM KU, Rahul Chaudhary, Karan Negi and Deepak Bhatt of HM 3rd Sem were felicitated for their exclusive contributions. Equally contributive were the Janmastami celebration through sketches and drawings. \r\n: HOBBY IS INDEED AN ACTIVITY DONE REGULARLY IN ONE’S LEASURE TIME FOR PLEASURE-ASCAB-AIHM:\r\n', '58.docx', '58.jpg', '2020-08-27', '2020-08-27 12:17:19', 1, 'dirAIHM'),
(59, 'Teacher’s Day 2020 ', 'The ASCAB- AIHM run Decoration Club laid emphasis on the important role of teachers through a well thought activity under the guidance of their student coordinators. They organized an activity where students prepared cards of different types to express their gratitude towards their teachers. These cards were dispatched to the faculty members.', 'x', '59.jpg', '2020-09-05', '2020-09-22 11:16:32', 1, 'dirAIHM'),
(60, 'World Tourism Day 2020', 'The pandemic has left mankind with little choice to movement. The surmount pressure that one faces within the confines of the home leaves an indefinable spirit but is it so with the ones who are mining their creativity by digging deep into the creative aspects of their life? Are we all sailing in the same boat of desperation and desolation? Is the world really getting confined like the ‘Lakshaman Rekha’ or are some fortifying their positivity and building their creativity?\r\nThe answer lies in the wonderful creation by the members of the ‘Decoration Club’ also published as ‘Creativity Club’ of AIHM-AGI. The comradeship built through exuberant grace of creativity has sent ripples of wonderful vibes of artistic display throughout AIHM. The young armors of Tourism and Hospitality Industry have raised their banners through their creativity even this time via posters and banners depicting the ‘World Tourism Day.’ The posters were projections of the travelers’ instinct to raise our spirits, galvanize the fire and heighten our hopes.\r\n', 'x', '60.jpg', '2020-09-27', '2020-10-06 12:23:35', 1, 'dirAIHM'),
(61, 'Webinar on HK practices', 'Housekeeping Department in Hospitality Industry is the so called COVID 19’ Warrior requiring as dynamic a policy as possible to swiftly slide onto the parameter of change. Adaptability has become the next game of the play induced by COVID that has hit the Hotel Industry the most. This has raised several questions in the mind of every individual as all are involved in the process of recreation as part of subsistence in today’s busy and engaging world. A discussion is therefore, the first priority of the industry and has enveloped the interest of both professionals and commoners’. A webinar was hosted by the Housekeeping Department, AIHM on the occasion of the International Housekeeper’s Week on 19th September, 2020. The theme was the ‘Effect of COVID 19 on Housekeeping Practices’. Many renowned personalities hosted the event with promising thoughts that the sun will definitely rise but preparations over several nights are important. Mr. Vinod Suhag, Regional Director of Housekeeping, Dubai, Mr. Gaurav Gangola, Manager, Housekeeping, Seychelles and Mr. Pallav Anand, Executive Housekeeper, Ghaziabad provided thoughtful insights to the guests for the post pandemic New World requirements and equipments that will help them meet the guest requirements.\r\nThe pandemic has definitely given a tough blow to the Hospitality Industry and its comeback will be even tougher with huge expectations from suspicious and aware guests that will turn as a challenge to the industry employees. The housekeeping practices will need to be upgraded with simultaneous preparations as medical equipments and general awareness of not just sanitary and hygiene requirements but also ways to handle the medical emergency without infecting oneself. Concern about cleanliness is pervasive. Hospitality will no longer remain ‘flawless and invisible’; it will have to take a centre stage in communication throughout the guest experience. The eminent speakers hold on to the thought of hospitality consultant Larry Mogelonsky of ‘Cleanliness Theatre’ akin to ‘Security Theatre’. It was a much required and essential online development at AIHM, Haldwani.\r\n', 'x', '61.png', '2020-10-12', '2020-10-12 12:46:59', 1, 'dirAIHM'),
(62, 'International Chefs’ Day2020', 'Over the past 16 years the World-chefs has used International Chefs day to honor the profession and to educate people about healthy food. It has enabled acknowledgement of the hidden faces behind the exquisite plates and tray that enhance the taste buds and bring smile to food lovers. They practically define the humorous thought- ‘I live to eat’. \r\nExtending its contribution on International Chef Day Amrapali Institute of Hotel Management distributed Bhojan Thal. Various food items were prepared in the AIHM restaurant by the faculty and distributed. Besides this the excitement was a webinar where the famous Chef Abhishek Basu, Executive Chef at JW Marriot, Mumbai and Chef Abhijit Bede, Executive Development Chef at Gate Gourmet discussed some nuances of the trait. The Management, Faculty and students were served with food of thought at their respective places and everyone enjoyed the knowledge shared by the experienced Chef. \r\nPassing knowledge for use by future generation, Are You? Well that’s what COVID 19 has blessed us with: ‘There is always a silver stream in the cloud of doubts.’\r\n', 'x', '62.jpg', '2020-10-20', '2020-10-22 10:15:18', 1, 'dirAIHM'),
(63, 'Webinar on Career Counseling', 'A Webinar on “Career Counseling & Job Prospects in Hospitality - Worldwide” was organized by Amrapali Institute of Hotel Management, Haldwani and GLOBAL WASE, jointly on 24th September, 2020 with Chef Jasvinder Singh Gurudatta as the guest speaker. Chef J S Gurudatta is the Director of Expedyte B2B LLC, USA.\r\nChef Gurudatta introduced himself and talked about his past work experiences, the heights that he has achieved; his thrilling journey from being a commercial pilot to becoming a Chef and now giving career guidance to students.\r\nThe webinar was attended by more than 100 students which lead to a wonderful interaction between students and Chef Gurudatta where the main topics were “work life during pandemic” and “Hospitality Industry after Covid-19” to which Chef Gurudatta expressed  himself by saying “Pandemics may come and go but life doesn’t stop. He said that the Hospitality Industry is massive and has a great future. All the norms and regulations regarding sanitization and hygiene practices were already being followed in Hotels since long back but this pandemic is like a reminder that we need to be more focused and strict regarding these practices. It’s just a matter of time and Hospitality Industry will again get back on its feet soon. Other topics discussed included ‘Scope of Fresher in Facility Management, Cruise Lines and Luxury Hotels worldwide”, Chef Gurudutta gave insight and inputs about it, to the budding hoteliers and guided them to pursue their career in their dream field. He asked students to remain focused and keep learning every day. It was a great learning experience for the students and he ended the webinar by motivating the students by saying “Don’t worry, there is always light at the end of the tunnel”.\r\n', 'x', '63.jpg', '2020-09-24', '2020-11-12 12:45:03', 1, 'dirAIHM'),
(64, ' Decoration Club Diwali 2020', '‘They Lasso thoughts with their pens\r\nJuxtaposing images and styles\r\nThe interior landscapes\r\nAre these their personal obsessions of cultures that-\r\nThey have absorbed as tools or an extension of human brain?’\r\nIt is well known to artists that during the Renaissance the term \'disegno\' implied drawing both as a technique to be distinguished from coloring and also as the creative idea made visible in the preliminary sketch. The COVID 19 phase has ultimate this art from creative hands and brought forth a new era of entertainment and hobby among the ‘Creative Club Members’ of the housekeeping department at AIHM, Haldwani. And- ‘as the sun went cold and pale as moon and festivities engaged men’, the club members crowned the festivities with their celebration of art in the form of artistic rangoli for Diwali wishing a happy and safe Diwali. Some skills need no endorsement and some work requires no felicitation as it emerges from the heart giving immense pleasure to the giver and receiver. Content in the word and the best day of these young artists are when they get to give art to others, we see them light up! \r\n', 'x', '64.jpg', '2020-11-14', '2020-12-07 10:02:32', 1, 'dirAIHM'),
(65, 'Cake Mixing Ceremony at AIHM', 'A harbinger of good tidings and happiness the cake mixing ceremony was performed blithe fully with social distancing amidst COVID 19 at AIHM. \r\n There is something very special about the AIHM Ground Floor Restaurant as it has witnessed many ceremonious occasions. Although cake mixing ceremony dates back to the 17th century in Europe its tradition continues at AIHM since its inception. A joyous moment, a rich experience of mixing the fruits and nuts and pouring rich wine over it all with a tinge of cooperation to spread camaraderie and goodwill is a souvenir for the organization. The blessings that come forth from the esteemed Management, Directors of various departments and through the presence of faculty and staff is celebration. This 2020 thus pitched in the gathering with different ingredients, vessels and labor and marked it as one big celebration of the heralding of Christmas.\r\n', 'x', '65.jpg', '2020-12-01', '2020-12-07 10:06:55', 1, 'dirAIHM'),
(66, 'AVAHAN 2020 ', '“Change is the end result of all true learning.” ― Leo Buscaglia\r\nThe 8th International Conference Avahan, the most influential hotel investment conference entitled, ‘Challenges Upfront and Future Prospective-Innovation, Entrepreneurship and Economic Policy’ was organized on 18th and 19th December through the online platform. It was an enticing, enriching learning with content-rich sessions and excellent networking platform. The  keynote speeches, stage interviews, and engaging panel discussions by the industry stalwarts and professional advisors from around the globe deliberating upon the sectoral trends, evolving market dynamics, operation related matters, industry nuances and best practices during the pandemic and after it becomes least effective through human efforts was a learning through the times of change. A huge ardor and diligent virtual gathering benefitted from the conference.\r\n', '66.docx', '66.jpg', '2020-12-19', '2020-12-23 16:03:36', 1, 'dirAIHM'),
(67, 'FDP on Soft Computing', 'Amrapali Institute of Technology and Sciences (AITS) organises a 5 days FDP on Soft Computing with Uttarakhand Technical University  Under TEQIP III during 2 September 2020 to 6 September 2020 For the FDP we have got good response of faculty members , Research scholars  from  various parts of India including J&K , Punjab , Hariyana , Rajsthan , UP, Madhya Pradesh , Siikim , Asam , West Bengal , Karnataka , Maharashtra , Gujrajt and offcourse   Uttaraknahd . The resource person Mr. Nitin Chandola taken a session on MATLAB fundamentals and functions in MATLAB, Different types of ANN simulations and working introduced and discussed in this session , a practical session on weather forecasting problem based on ANN also presented by the Resource person.<br>\r\nThe resource person Mr. Pankaj Swaroop Nitin Chandola taken the session on Genetic Algorithms and their implementation  using  MATLAB   , further he Delivered detailed session on  different functions like mutation , survival of fittest , binary diffusion that are very useful for artificial Genetic Algorithms  processing operations in many areas . Different types of Genetic Algorithms examples with MATLAB  implementation  introduced and discussed in this session , a practical session on  also presented by the Resource person. <br>\r\nE-Certificates Distributed to all the participants. \r\n', '67.docx', '67.jpg', '2020-09-02', '2021-01-09 10:35:14', 1, 'nitin'),
(68, 'Online Machine Learning Prog', 'Amrapali Institute of Technology and Sciences and Uttarakhand Technical University jointly organized a 6 Day Online Student Development Program on Machine Learning from 10th - 15th December 2020 under TEQIPIII.<br>\r\nThe Experts for the Online Learning Program were Mr. Mohd. Rashid, Ms. Anchal Sharma and Mr. Nitin Chandola. Prof. (Dr.) M. K. Pandey, Director AITS warmly welcomed the Experts and the students to the Workshop during his Address. He said that the students must keep themselves updated with the latest technologies during this age of intense competition. He also assured that similar Workshops will be organized in the future too.<br>\r\n269 Students actively participated in the learning sessions. The Students learnt the various aspects of Machine Learning and related fields such as Artificial Intelligence, Data Mining and Data Sciences etc. Students grasped the various applications and scope of Machine Learning in a lot of day-to-day tasks like Number plate Detection, Fraud Detection, Email, Review and Feedback analysis, Face Detection and age prediction, Emotion Detection Automated Car-parking etc.<br>\r\nThe Vote of Thanks was proposed by Mr. Anurag Bhatt, Coordinator of the Workshop. The Technical support and Media support was provided by Dr. Nitin Deepak, Dr. Hitendra Jalal and Mr. Rahul Palaria respectively.', '68.docx', '68.jpg', '2020-12-10', '2020-12-28 16:29:14', 1, 'nitin'),
(69, ' FDP on Cyber Security', 'Amrapali Institute of Technology and Sciences (AITS) organises 5 Day Online Faculty Development Programme on Cyber Security  under the aegis of TEQIP III Uttarakhand Technical University in the duration between 16th-Sep to 20th September 2020. <br>\r\nFor the FDP we have got good response of faculty members, Research scholars  from  various parts of India including J&K , Punjab , Hariyana , Rajsthan , UP, Madhya Pradesh , Siikim , Asam , West Bengal , Karnataka , Maharashtra , Gujrajt and offcourse   Uttarakhand.<br>\r\nFDP starts with the welcome note by our respected Director Dr. M. K. Pandey then Our respected resource person Mr Ashwin had taken the ethical hacking sessions and Mr Sanjay had taken the session of Cyber Laws. A practical sessions had also been taken by Mr Ashwin on Kaali Linux.<br>\r\nThe Vote of Thanks was proposed by Dr. Nitin Deepak, Coordinator of the FDP. The Moderator Dr Ashish B. Khare gracefully tenor the forum and guiding FDP conduct. The Technical support and Media support was provided by Dr. Hitendra Jalal and Mr. Rahul Palaria respectively.', 'x', '69.jpg', '2020-09-16', '2021-01-09 10:30:36', 1, 'nitin'),
(70, 'And I make grape decisions!!', 'An enriching experience was shared by Mr. Sanjay Singh Ranghar, Anantara Hotels and Resorts, Muscat Oman through a Knowledge Booster online session conducted by the F&B Department, AIHM, Haldwani. The ripe juicy grapes and wine tasting techniques dominated the session with an enthusiastic gathering of students.', 'x', '70.jpg', '2020-12-30', '2020-12-31 12:11:21', 1, 'dirAIHM'),
(71, 'CATIA - (SDP)', 'Amrapali Institute of Technology and Sciences (AITS) and Uttarakhand Technical University jointly organized a 5 Day Online Student Development Program on CATIA- Modelling & Design Excellence from 5th - 9thSeptember 2020 under the aegis of TEQIPIII.<br>\r\nA Five-day student development program on CATIA began at Amrapali Institute of Technology and Sciences on Saturday. The student development program is aimed at enhancing the students of Mechanical Engineering with modern engineering design and simulation tools. The Experts for the Online student development Program wasMr. Rahul Sudhakar Rao Konde.Director Prof. (Dr.) M. K. Pandey, Director AITS inaugurated the workshop. Speaking on the occasion, he said that the workshop was being conducted with experts from the industryand the students must keep themselves updated with the latest technologies and advances during this age of intense competition. Skills, Real Time, information and Updated learning are the aspects which tackle the students from the industry. To overcome those aspects, the Institute had been imparting coaching, workshops and development programs to the studentsin the much-needed field.By knowing these courses, the students would be in a position to face practical challenges in industry and apart from learning skills these type of programs also would help them in facing interviews, he added.\r\nAn overview on the importance of 3D modelling software in modern industries was given by coordinator Mr. Hitendra Bankoti. Industry expert Mr. Rahul Sudhakar Rao Konde started the program on CATIA which comprises of a basic Introduction to CATIA V5 followed by demonstration of various tools for Part Modelling. Student development program also included hands on practice session for 3Dimensional Part Modelling& Design to make students acquainted with this software. Part Modelling was followed by Assembly Design & analysis of the system. Studentswere delighted to participate in this program & they look forward to attend more such type of programs &workshops in future. <br>\r\nThe session was concluded by Vote of Thanks, proposed by Mr. Hitendra Bankoti,Coordinator of the Workshop. The Technical support and Media support were provided by Dr. Nitin Deepak, Dr. Hitendra Jalal and Mr. Rahul Palaria respectively.\r\n', '71.docx', '71.JPG', '2020-09-05', '2021-01-09 10:30:05', 1, 'nitin');
INSERT INTO `activities` (`ID`, `TITLE_`, `BRIEF_`, `DET_PATH`, `PICTURE_PATH`, `DATE_OF_ACTIVITY`, `DATE_`, `STATUS_`, `USERNAME_`) VALUES
(72, ' Occasion of Xmas & New Year', 'Christmas is, probably the most widely held celebration in the world. The traditional Christian approach to the festival has its own attraction and charm which cannot be substituted. People around the world indulge into some of the most wonderful aspects of the Christian element of the event, such as attending a Carol Service or going to Midnight Mass on Christmas Eve. \r\nMerry Christmas 2020: Xmas and New Year is the holiday season across the world. It is the time to indulge and make merry but make sure to wear your mask and avoid large gatherings. During Xmas amid the pandemic, it\'s important that we connect and tell each other that no one is alone. Today there are so many ways of staying safe and being with friends and family.\r\nWe here bid goodbye to the year 2020 which taught us that together we can fight against any evil or disease and only humankind prevail. We also welcome the year 2021 with positive hope that this year will bring us all good health and celebrations.\r\nOn the occasion of Xmas and New Year it is all about spending time with family and close friends and sending greetings to loved ones staying far away and at AIHM the students celebrated this occasion by following social distancing yet the celebrations were at full swing.\r\nMembers of Decoraton club, AIHM like Rahul Pandey, Eshneet Kaur, Krishan Kumar, Rohit Kumar Shah, Deepak Bhatt, Rahul Chaudhary, Himanshu Agari, Rajesh Pandey, Kiran Pandey, Nandan Singh were the flagbearers of this celebration at AIHM. They made some beautiful decoration creations and shared with each other which were a welcome gesture to the Year 2021.\r\n', 'x', '72.jpg', '2021-01-01', '2021-01-12 12:38:36', 1, 'dirAIHM'),
(74, '\'Learn from ant’ FHM ', '‘Learn from ant’ the social being is an old notion but a new insight to crack the hospitality interview was provided by Mr. Anurag Sharma, the founder of LFA Consulting LLP. This session was organized by Mr. Pawan Mehra, the lead behind the training and placement cell at AIHM.\r\nThe online session introduced the students with the requirements of the day as far as understaning an interview is concerned. Every human on job or even in business has been involved intuitively in interview. The talk delivered by Mr. Anurag Sharma was a motivation through techniques that says, ‘Interview is a way to reach out your skills for the desired job.’ There is no loss or wins in interview, it is only a two way requirement and if you fit in it you get through otherwise the world is a huge place of opportunity. \r\nThe session was followed with a question answer hour and the students’ queries were solved. Volumes to speak and learn from experts and when it comes to real life you just can’t skip such moments.\r\n', 'x', '74.jpg', '2021-01-16', '2021-01-21 16:27:59', 1, 'dirAIHM'),
(76, 'Gourmet Club Activity, FHM', 'The last day of December was celebrated through the Sous Vide online session for students of the Gourmet Club. The session was conducted by Chef Vikas Sah who introduced modernity in cooking style. He showed the students how taste, flavor and that tinge can be retained through the modern way of cooking food in the plastic bag heated on a water bath. The temperature plays a great role. Complementary winsome act reflected online.\r\nThe 16th day of January 2021 was an entertaining day.\r\nThe Gourmet Club’s taste of Sous Vide food was not yet over that they rolled in scientific cooking through the Molecular Gastronomy session. The science of cooking in an artistic manner to serve the eyes and raise the taste buds! Chef Mohit Arya gave a delightful session on molecular a gastronomy that will definitely kill the boredom of ‘COVID ‘, stay indoors. Students understood there is more to the world than one can apprehend. \r\n', 'x', '76.jpg', '2021-01-16', '2021-01-22 12:51:04', 1, 'dirAIHM'),
(77, 'WEBINAR ON PROJECT HOTELS', 'A Webinar was planned and successfully completed on 19th January 2021 by the Housekeeping department under the flagship of Amrapali Institute of Hotel Management, Haldwani. This session was planned and conducted keeping in mind the challenges and issues confronted both by the teacher in terms of making the students understand as well as by the student who is not in a position to visualize the center of the lecture. The participants were the faculties and the students of final year. The topic for the Webinar was NEW PROPERTY COUNTDOWN –Housekeeping in Newly Made Hotels and the resource person for this Webinar was Mr. Gaurav Singh Gangola, Manager Housekeeping, Seychelles. Brief Introduction of Mr. Gaurav Singh Gangola After passing out from IHM, Meerut in 2012 he started his career by working with The Oberoi Udaivilas, Udaipur and then worked at the supervisory and managerial level. Then finally rose to the position of Housekeeping Manager at Le Chateau De Feuilles –Seychelles. Mr. Gangola stared the session by illuminating the role of the housekeeping. He said that the housekeeping department of a hotel is the heart of the hotel. It is responsible for the cleanliness, maintenance, and aesthetic upkeep of the hotel. The role of housekeeping unlike food and beverage or the front of the house department’s starts way before the hotel commences as a full- fledged operation. The pre - opening calendar for any property starts two-three years ahead, but it is unrealistic to suppose that every executive housekeeper can be hired far enough in advance to take part in the original planning with top management and the architects. However, in some cases it is possible to plan ahead who your housekeeper will be and consult her in advance about the entire housekeeping operation. Other important points covered by him were every hotel prepares a Mock up Room for the start to attract the clientele. Also the entire project is completed under the guidance of the Project General Manager. During the entire pre-opening stage Snagging List plays a vital role which has more than 460 points. The session was concluded by adding the last point which is the handover from the Project Team starts and the handover is cross checked with De- Snagging list. This is very helpful in getting the things done accurately without any hiccups or complains.', 'x', '77.jpg', '2021-01-19', '2021-01-22 12:43:30', 1, 'dirAIHM'),
(78, 'Video making competition,FHM', 'A session came rolling out on the 23rd of January 2021 as a competition from Front office department by Ms. Mandeep Kaur Bankoti who officiated  a video competition for students interested in Club for Change activities. The winner of the activity was Mr. Bablu Parihar from BHM KU 7th Sem. Video display on Bomb Threat, Theft, Accidental fire in restaurants and hotels were produced by a large number of students.', 'x', '78.jpg', '2021-01-23', '2021-01-27 16:13:15', 1, 'DIRaihm'),
(79, 'Webinar culinary department', 'An online session was organized by the Culinary Department, AIHM on the 25th of January where Chef Sagar Rajput, a renowned cook at BOURY, Belgium introduced the young minds with thoughts on culinary challenges, recipe formulation and new evolving techniques. Chef Sagar Rajput’s style of delivery left a mark in the heart on every listener and students learnt in abundance.', 'x', '79.jpg', '2021-01-25', '2021-02-13 12:10:03', 1, 'dirAIHM'),
(80, 'Webinar on Marketing, FHM', 'New trend new techniques on the way\r\nA webinar that paves way to future trends through technology was organized online on the 30th of January by the Front Office Department, AIHM Haldwani. The speaker, Mr. Manasvee  Pushkarna, Director of sales from Taj Swarna, Amritsar  delivered a great session on how to deal with the pandemic through marketing techniques to enhance room revenue.\r\n', 'x', '80.jpg', '2021-01-30', '2021-02-03 16:09:22', 1, 'dirAIHM'),
(81, 'Knowledge booster,T & P cell', 'More is less: the mantra \r\nAn online platform shared by Mr. Gurmeet through the efforts of the placement cell at AIHM was an enthusiasm for all during the pandemic. Mr Gurmeet uplifted the spirit of the audience through his experience and emphasized on adding multi-skill to traits for success in the near future. His presence and speech brightened everyone and filled hoteliers with hope of a bright future.\r\n', 'x', '81.jpg', '2021-02-01', '2021-02-03 16:12:49', 1, 'dirAIHM'),
(82, 'FDP om ANSYS', 'In this technological era, there is a compelling need of computational analysis and engineering simulation in the world of engineering and technology. This is because of the widespread use of simulation across product development and optimization workflows in the industries. Keeping in this mind, Amrapali Institute of Technology and Sciences, Haldwani had organized a Five day faculty development program (Online) on ANSYS. The program was held from the 17th Sep 2020 – 21st September 2020 in the Department of Mechanical Engineering, under the aegis of TEQIP-III, Uttarakhand Technical University, Dehradun. <br>\r\nThe purpose of such faculty development programme is to enhance the performance of faculty members in education and research as well as augmenting organization capacities and culture. <br>\r\nMr. Ashish Dixit, coordinator had given the overview of this five-day faculty development programme to the attendees. Mr. Ashtosh Kumar Singh was the moderator for all the sessions.<br>\r\nThe session was concluded by vote of thanks, proposed by Mr. Hitendra Bankoti, Co-coordinator of this faculty development programme. The technical support was provided by Dr. Nitin Deepak and Dr. H S Jalal.\r\n', '82.pdf', '82.png', '2020-09-17', '2021-02-10 12:52:28', 1, 'dirmca'),
(83, 'Online Debate Competition', 'Faculty Of Commerce and Business Management, Amrapali Group Of Institutes, Haldwani organized an online debate competition on ‘Is Budget 2021 leading India towards $5 Trillion Economy’ on February 3rd, in which the Management & B.COM- HONS students participated.\r\nThe students enthusiastically discussed the various aspects of the Budget, voicing both their concerns and their expectations. While some termed the budget as progressive and the best possible in the backdrop of the economic slowdown, others called it a damp squib.\r\nThe expert of the session who is a young practicing fellow Chartered Accountant  Mr Digvijay Singh threw light on key budgetary announcements.\r\n\r\nThe program was coordinated by Ms. Priya Tewari-(BBA) and Ms. Babita Rawat-(BCH-HONS).\r\n\r\nThe competition was judged by Faculty members Dr Deep Chandra Oli, Dr Anand Kr Srivastava & Mr Amit Thaker.\r\n\r\nThe session dovetailed into the challenges put forth by the pandemic on the Indian economy and how best to utilize the budget for the year to help the nation spring back from these troubled times.\r\n\r\nThe 3 Winners of the competition are as follows:\r\n\r\n1st position- Mukul Kathayat( MBA 1st)\r\n\r\n2nd position- Tanveen Kaur( MBA 3rd)\r\n\r\n3rd position- Tithi Aggarwal( BBA 3rd).\r\n\r\nA huge congratulations to all the participants- \r\nVasundhara(BBA 1st)\r\nDivya Rautela( MBA 3rd)', 'x', 'sample.jpg', '2021-02-03', '2021-02-12 09:50:24', 1, 'dirmba'),
(84, 'Webinar culinary department', 'Story telling went through various steps of development to communicate with the little ones. It is amazing to note how fruit carving that started in China during the Tang Dynasty, which lasted from AD 618-906 became a legend and story communicator. Now fruit carving is restricted to corporate functions and massive occasions. A session on various enthalpies arousing the mind to become creative so that the platter not just fulfills the stomach’s requirement but also establishes the desire to more eye catching recipes with beautiful arrangement was held online on the 6th of February, 2021 where the students gathered in large number to discover more. It was an endeavor of the Gourmet Club under the Food Production Department and delivered by Chef Mr. Mohit Mathur of Hotel Lalit Jaipur. The Chef introduced the term Garde Manger that means different things in the modern professional kitchen. It refers to the cool refrigerated area where cold dishes and salads are prepared. The Chef emphasized the techniques, preparation objectives and methods of preparing and serving Cold Buffets that are the main attractions of the industry these days. Culinary is full of challenges and to face them requires a student to be aware and well equipped with knowledge. The Chef briefed about the professional kitchen and techniques involved therein and it was appreciated by all.', 'x', '84.jpg', '2021-02-06', '2021-02-12 15:53:45', 1, 'DIRaihm'),
(85, 'Webinar on RDM, FHM', 'Monday, the 8th of February was another knowledge booster day for the students and faculty at AIHM, Haldwani when the Training and placement Cell organized a session on RDM perspectives with Mr. Ashwin Vaidya, Director of rooms –Renaissance & Marriott Apartment, Mumbai. It was a practical introduction to the demands of the industry and its fulfillment for guest safety during their stay. The industry thrives through the guest and Mr Vaidya briefed how the Marriott has enhanced its cleanliness drive with best concern towards the associates and Guest.\r\nA key in the hand or a key in the phone makes a world of difference; it is a possession worth mentioning. There are many more things worth mentioning while the world is recovering from the pandemic menace and it’s after effects. Mr. Ashwin Vidya spoke about the various new introductions at Marriott to help develop safety norms and advocate its usefulness to the Guest as they arrive back to the Hotels. He spoke about Management strategies, Enhanced technology to counter virus spread, social distancing protocol, food safety protocols and Mariott Bonvoy and much more to make the guest feel comfortable as he arrives amidst the pandemic. The wheel of the cart moves on and on but in different forms and so does the world with a few necessary changes. Mr. Ashwin Vaidya’s talks were a great relief to the worried souls back stage whom the pandemic has left anxious.\r\n', 'x', '85.jpg', '2021-02-08', '2021-02-12 15:57:38', 1, 'DIRaihm'),
(86, 'Culinary Webinar, FHM', 'Tradition stays while trend changes\r\nThe new norms have not much place in the Hotel Brands that were already well versed with cleanliness. They had not to reorient them; they had to simply upgrade the way to reach out to the guest. They dug to the scientific ways of food preparation and preservation.\r\nIn a lively session with Chef Himanshu Taneja, Culinary Director, South Asia at Marriott International, on the 15th day of February, the entire Hotel Management Institute was abuzz with the reverberation of wellness food, ayurvedic inputs, healthy meals and the much desired scientific preparation for the guests. The session was organized by the Placement and Training Cell, AIHM in coordination with the Food Production Department for the benefit of the students.\r\n', 'x', '86.jpg', '2021-02-15', '2021-02-15 16:11:34', 1, 'dirAIHM'),
(87, 'Knowledge booster, FHM', 'They fog the room to help you cherish the serenity and view of the misty Himalayas\r\nA word from Mrs. Manjeet Kaur, Director Housekeeping in the Ananda in the Himalayas helped students to gain insights into the new norms and protocols as far as Housekeeping is concerned. The online session was organized by the Housekeeping Department at AIHM. A day in the Hotel functioning after the menace of the pandemic is under vigilance was virtually obtained through the online talk and students were made aware of the latest in use housekeeping gadgets and techniques. Queries of the inquisitive students were also replied to their satisfaction by the expert and the knowledge booster series at AIHM thus continued through sharing and enhancing knowledge.\r\n', 'x', '87.jpg', '2021-02-23', '2021-03-02 14:53:06', 1, 'dirAIHM'),
(88, 'Hospitality reorientation', 'The New Mantra for the day was ‘Put People First’. ‘Take care of your associates and they will take care of the guest’ and ‘embrace change to move ahead’. \r\nThe online session on the 25th of February by Mr. Abhay Singh, Director of Operations, The Westin, Pune was made lively and entertaining by the videos that he shared with his speech. It resonate the spirit of the students and encouraged them to stand dedicated as they understood that its importance does stand in every sphere of work. The reward that the organization gives to its employees is indeed work culture.\r\n', 'x', '88.jpg', '2021-02-25', '2021-03-03 15:20:30', 1, 'dirAIHM'),
(89, '5 Day SDP on AI', 'Amrapali Institute of Technology and Sciences and Uttarakhand Technical University, Dehradun jointly organized a 5 – Day Online Training Program on “ARTIFICIAL INTELLIGENCE” from 10th February – 14th February 2021 under TEQIP - III.<br>\r\nThe Online Training Program started with an introduction to Artificial Intelligence and fundamentals of Python Language. ‘NumPy’, a very useful Python library was discussed and its function was explained for working in domain of linear algebra, Fourier transform, and matrices. ', '89.docx', '89.jpg', '2021-02-10', '2021-03-09 15:44:30', 1, 'dirmca'),
(90, 'Live Webinar', 'FCBM- AGI, organised a Live Webinar for students on \"Career and Job roles in Financial services Industry - A complete analysis.” on 2nd March 2021 at 10 am. The Expert for the Session was Shri Aditya Gadge, Founder & CEO of AIWMI. The attendees discussed about the Career Options and Job roles in Banking, Insurance, Mutual Funds, Alternative Investments,Family Office Investments, Financial Modelling, Pension funds, credit analysis etc.', 'x', 'sample.jpg', '2021-03-02', '2021-03-10 10:33:23', 1, 'dirmba'),
(91, 'FO Webinar, FHM', 'Empathy to Emotions; all is required to participate in the road towards recovery\r\n\r\nMr. Ragvendra Pratap Singh, Associate Director of Sales, Holiday Inn, Gurugram, is an alumni of AIHM, Haldwani and his benign presence online on 6th March was an inspiration to all the students. We look for targets and set goals through creation of role models. Mr Raghvendra Pratap Singh with his gracious personality has all that a role model must possess in him. His talk on customer policy and engagements was equally encouraging and appealing.\r\n', 'x', '91.jpg', '2021-03-06', '2021-03-10 15:02:37', 1, 'dirAIHM'),
(92, 'Women’s Day 2021', 'Help forge a gender equal world- AIHM contributes its share on International Women’s Day\r\nHow a journey of thousand miles begin is as important as how it continues. The landmark day in the history of humanity came as a decision when women folk, the ones considered less blessed and bound by traditions that abort bravery came out in tens and thousands to protect the feminine rights. The world acknowledged the feminine power and thus came the humility to celebrate it as a day, the day being 8th March. AGI came forward to increase visibility of women creative and AIHM forged its activity through hosting the show with decoration by Housekeeping and Front Office Department, Food and Beverages and service by the Food Production and Service Department. The Women’s Day was felicitation of known women personalities.\r\n', 'x', 'sample.jpg', '2021-03-08', '2021-03-15 10:49:34', 0, 'dirAIHM'),
(93, 'Women’s Day 2021', 'Help forge a gender equal world- AIHM contributes its share on International Women’s Day\r\nHow a journey of thousand miles begin is as important as how it continues. The landmark day in the history of humanity came as a decision when women folk, the ones considered less blessed and bound by traditions that abort bravery came out in tens and thousands to protect the feminine rights. The world acknowledged the feminine power and thus came the humility to celebrate it as a day, the day being 8th March. AGI came forward to increase visibility of women creative and AIHM forged its activity through hosting the show with decoration by Housekeeping and Front Office Department, Food and Beverages and service by the Food Production and Service Department. The Women’s Day was felicitation of known women personalities.\r\n', 'x', '93.jpg', '2021-03-08', '2021-03-15 10:49:47', 1, 'dirAIHM'),
(94, 'One Week SDP on Aptitude', '<b>Amrapali Institute of Technology and Sciences</b> and Uttarakhand Technical University jointly organized a One Week Training Program On Aptitude (Reasoning) from 12th March 2021 onwards under TEQIP-III. The Experts for the Online Learning Program were Mr. Himanshu Gupta and Mr. Ashuthosh.<br>\r\nProf. (Dr.) M. K. Pandey, Director AITS warmly welcomed the Experts and the students to the Student Development Program during his Address. He said that all the students required having expertise in solving aptitude and reasoning question which will help the students to get their job in efficient manner. He also assured that similar Workshops will be organized in the future too.\r\nNear about 100 Students actively participated in the learning sessions. The Students learnt the various methods of aptitude and reasoning. This training is conducted to boost-up candidate’s Problem solving ability and to test how efficiently a student can respond to a task or a situation. The areas those are generally tested are Numerical Ability and Quantitative Aptitude, Logical reasoning, Data sufficiency and Interpretation.<br>\r\nThe Vote of Thanks was proposed by Dr. Suresh Chandra Wariyal, Coordinator and Mrs. Preeti Pandey Co-Coordinator of the Workshop. The Technical support and Media support was provided by Dr. Nitin Deepak and Mr. Rahul Palaria.', '94.docx', '94.jpg', '2021-03-12', '2021-03-24 09:11:52', 1, 'nitin'),
(95, ' Presentation contest, FHM', 'Be the change that you want to bring.\r\nThe first initiative to prepare students for after COVID 19 effects is to introduce technological skills in them. The Club for Change under the Department of Front Office in coordination with the co curricular team at AIHM introduced the concept of Power Point Presentation among their member students. An activity through power point presentation on various topics like COVID 19 and Hospitality Industry, Spiritual Tourism, Adventure Tourism etc was planned on 23rd March. The students displayed the learning that the club coordinators had instilled in them during the club hours and gave fantastic engrossing power point presentations to express their views. It was a wonderful engagement during the lovely spring afternoon.\r\n', 'x', '95.jpg', '2021-03-23', '2021-03-26 10:18:35', 1, 'dirAIHM'),
(96, 'Competition at UOU Haldwani.', 'Uttarakhand Open University organized a Poster Making and Essay Writing Competition on the topic NAMAMI GANGE for the students on 7th April 2021, where many students from different institutes participated to show case their talent. Some creative students of Amrapali Institute of Hotel Management also participated for the competition and finally secured two positions as well.We wish Mr. Sarthak Shah and Mr. Rohit Shah students of AIHM for securing second and third position respectively.', 'x', '96.jpg', '2021-04-07', '2021-04-29 15:27:44', 1, 'dirAIHM');
