(1, 'Prof(Dr.) M. K. Pandey', 'x010/x010/x010', 'FTCA', 'A0', 'DIRECTOR', 'X010', 'X010', 'X010', 'M.Sc. (Maths.), MCA, Ph.D.', 'x', 'x', '1.jpg', 'x', '', 'director.mca@amrapali.ac.in', '', 'nitin', 1, '0000-00-00 00:00:00'),
(2, 'Mr. Prashant Rajput', 'x010/x010/x010', 'FTCA', 'A11', 'Associate Professor', 'X010', 'X010', 'X010', 'MCA, Pursuing Ph.D.', 'x', 'x', 'x', 'x', '', '', '', 'admin', 1, '0000-00-00 00:00:00'),
(3, 'Dr. M.K. Sharma', 'x010/x010/x010', 'FTCA', 'A1', 'Professor', 'X010', 'X010', 'X010', 'MBA, M. Tech.,Ph.D.', 'x', 'x', '3.png', '3.docx', 'Prof. (Dr.) M.K. Sharma is associated with Amrapali Group of Institutes from last 16 Years , Presently He is working as Professor of Computer Science and Applications , he has 16 years of  teaching experience in PG and UG courses including MCA, M.Tech and Ph.D Students , He has Authored 10 books  on Different Subjects of Computer Science  and  contributed many research papers and articles in international ,national journals and magazine  , 6 Ph.d Scholars have been completed their Ph.D in His Guidance and 5 are perusing , Member of USERC (Uttarakhand), He Member of board of Studies and Research Committee of Kumaun University , HNB Gharwal University , Uttarakhand Open University , Uttarakhand Technical University, Trithankar Mahaveer Uniersity , Dev Sanskriti University ,Haridwar and many more ', 'sharmamkhld@gmail.com', '9897562188', 'dirmca', 1, '0000-00-00 00:00:00'),
(4, 'Dr. Raj Kishore Bisht', 'x010/x010/x010', 'FCSA', 'A12', 'Associate Professor', 'X010', 'X010', 'X010', 'M.Sc., Ph.D.', 'x', 'x', 'x', 'x', '', '', '', 'admin', 0, '0000-00-00 00:00:00'),
(5, 'Dr. Ashish Bhushan Khare', 'x010/x010/x010', 'FTCA', 'A2', 'Asst. Professor', 'X010', 'X010', 'X010', 'MCA, Pursuing Ph.D.', 'x', 'x', '5.jpg', '5.docx', 'I am currently working as Asst. Professor at Faculty of Computer Science & Applications, Amrapali Group of Institutes, Haldwani. I have been awarded degree of MCA from HNBG University, Srinagar Garhwal, Uttarakhand in Year 2003. I am having academic experience of 12.5 years with BCA and MCA programme. My specialization includes Operating Systems, Computer Networks, Mobile Communication, E-governance and Computer System Architecture.  My other areas of interest include Parallel Computing, Data Mining and Warehousing and Cloud Computing. I am pursuing my Ph. D in Computer Science from Bhagwant University, Ajmer and in award of same; I have successfully submitted my Pre-thesis and completed my Pre-Ph. D presentation. I have my research publications in several International Journals and have attended various seminars and technical workshops in the field of Computer Science & Applications.', 'kharegeminine8@gmail.com', '9927016736', 'dirmca', 1, '0000-00-00 00:00:00'),
(6, 'Dr. Nitin Deepak', 'x010/x010/x010', 'FTCA', 'A21', 'Associate Professor', 'X010', 'X010', 'X010', 'Ph.D., M.Phil, MCA, PGDCA', 'x', 'x', '6.jpg', '6.pdf', 'Dr. Nitin Deepak is associated with Amrapali Group of Institutes from last 15+ Years. Presently working as Asst. Professor iin Faculty of Computer Science and Applications. Having 15+ years of  teaching experience in PG and UG courses including MCA, BCA. He has contributed many research papers and articles in international, national journals and magazine. Also guiding 1 Ph.d Scholar. His specialization includes Algorithms, Software Engineering, Data-Structure and Web-Technology and above all passionate about web and app development.', 'nitin.d12@gmail.com', '9760020667', 'nitin', 1, '0000-00-00 00:00:00'),
(7, 'Dr. Mukesh Joshi', 'x010/x010/x010', 'FCSA', 'A22', 'Asst. Professor', 'X010', 'X010', 'X010', 'MCA, M.Phil., pursuing Ph.D.', 'x', 'x', '7.jpg', '7.pdf', 'Mr Mukesh joshi is having an teaching experience of 13 years in PG and UG Courses. He did his Post Graduation in year 2005 and Submitted his PhD (CSA) in year 2017. He has also qualified USET (Uttarakhand State Eligibility Test). He has Presented many research papers in National and International Confrences/Journals. He has been also awarded with three best research papers in International Confrence at Teertahnker Mahaveer University,Moradabad.', 'mukul.san@gmail.com', '9410170681', 'dirmca', 0, '0000-00-00 00:00:00'),
(8, 'Dr. H.S Jalal', 'x010/x010/x010', 'FTCA', 'A23', 'Associate Professor', 'X010', 'X010', 'X010', 'Ph.D., MCA, M.Com, DOEACC A Level,  PGDECOM.', 'x', 'x', '8.jpg', '8.docx', 'Dr. Hitender Singh Jalal is a teacher, speaker, advisor and researcher. He joined the Institute on Apr 12, 2002. He has 19 years of teaching experience. He is Master of Commerce & Computer Applications. He has been awarded a Ph.D. in Computer Science. His area of specialization is Pervasive Computing, Accounting & Financial Management, Programming Languages and Multimedia.  He has published several research papers in national and international journals and attended various seminars and conferences in the field of Computer Science.', 'jalalhemu@gmail.com', '9897122528', 'nitin', 1, '0000-00-00 00:00:00'),
(9, 'Mr. Nandan Singh Dasila', 'x010/x010/x010', 'FTCA', 'A24', 'Asst. Professor', 'X010', 'X010', 'X010', 'M.CA, pursuing Ph.D.', 'x', 'x', 'x', 'x', '', '', '', 'admin', 1, '0000-00-00 00:00:00'),
(10, 'Mr. Nirmal Pandey', 'x010/x010/x010', 'FTCA', 'A25', 'Asst. Professor', 'X010', 'X010', 'X010', 'MCA', 'x', 'x', '10.JPG', '10.doc', 'I am currently working as an Assistant Professor at Faculty of Computer Science & Applications, Amrapali Group of Institutes, in Haldwani. I have been awarded degree of MCA from Kumaun University, Nainital, in Year 2000. I am having software industry experience  of 6 years and professional academic experience of 10 years with BCA and MCA programme. My specialization includes Core Java,Advanced Java,Object Oriented Analysis & Design with Java,Advanced Software Engineering.I am pursuing my Ph. D in Information Technology(Artificial Neural Network) under the guidence of Prof.(Dr.) R.P.Pant ,from Kumaun University, Nainital . I have my research few publications in some International Journals and have attended few seminars and various technical workshops especially at Central University of Rajasthan in Ajmer and at IIT-Roorkee organized by IECT & Dept. of Electronics in the field of Mathematical Computational Science, Computer Science & Applications.', 'nirmal.bias@gmail.com', '8909228624', 'dirmca', 1, '0000-00-00 00:00:00'),
(11, 'Dr. Naveen Tewari', 'x010/x010/x010', 'FCSA', 'A26', 'Asst. Professor', 'X010', 'X010', 'X010', 'PhD, MCA, Developer in Multimedia, CIH', 'x', 'x', '11.jpg', '11.docx', 'Dr. Naveen Tewari, having 10 years of Teaching experience in Post Graduate and Under Graduate Program.  He did his Ph.D. (Computer Science) from Bhagwant University, Ajmer in 2015. He has done MCA from Maharishi Dayanand University, Rohtak.  He is also a Developer in Multimedia (Certified by Arena Multimedia).  He has contributed many research papers in various International and National journals. He is also on Reviewer board of many reputed International journals. 3 Scholars are doing Ph.D. under his guidance. His area of interest is Cloud computing, web programming, Programming Methodologies and Object Oriented Concepts.', 'navtewari@gmail.com', '7895089999', 'nitin', 0, '0000-00-00 00:00:00'),
(12, 'Mr. H.V. Pant', 'x010/x010/x010', 'FTCA', 'A31', 'Asst. professor', 'X010', 'X010', 'X010', 'MCA', 'x', 'x', '12.JPG', '12.docx', 'I have evolved as an academician primarily during my stint at the Amrapali Group Of Institute, which I joined in 2002 as a Lab Instructor. During the first few years, I was posted in the Computer Lab that exists as per Kumaun University’s mandate. Since my promotion as Lecturer in 2009, my primary job responsibility has been to teach various subjects, viz. DataBase, Visual Basic, Network Operating System, C, C++ and Business Data Processing. During the semester currently underway, I am teaching Network Operating System and Business Data Processing subjects to students of Bachelor of Computer Applications course and guiding students of Master of Computer Applications course in various projects in Visual Basic subject. Apart from classroom teaching, I have been entrusted with additional responsibilities, the performance of which has enhanced my capabilities and skills. These opportunities have led me to improve consistently as a professional as well as an academician.', 'pant.vardhan@gmail.com', '8192850007', 'dirmca', 1, '0000-00-00 00:00:00'),
(13, 'Dr. Suresh Ch. Wariyal', 'x010/x010/x010', 'FTCA', 'A33', 'Asst. professor', 'X010', 'X010', 'X010', 'MCA, pursuing Ph.D.', 'x', 'x', '13.jpg', '13.doc', 'I am currently working as Asst. Professor at Faculty of Computer Science & Applications, Amrapali Group of Institutes, Haldwani. I have been awarded degree of MCA from Kumaun University, Nainital, Uttarakhand in Year 2006.I have been also awarded degree of M.Tech from Uttrakhand Technical University in 2012. I am having academic experience of 9 years with BCA and MCA programme. My specialization includes Operating Systems, Computer Networks, Enterprise Resource Planning and Advance database management. I am pursuing my Ph. D in Computer Science from Bhagwant University, Ajmer. I have my research publications in several International Journals and have attended various seminars and technical workshops in the field of Computer Science & Applications.', 'swariyal@gmail.com', '9927367445', 'dirmca', 1, '0000-00-00 00:00:00'),
(14, 'Dr. Nitin Pandey', 'x010/x010/x010', 'FTCA', 'A36', 'Asst. professor', 'X010', 'X010', 'X010', 'MCA, pursuing Ph.D.', 'x', 'x', 'x', 'x', '', '', '', 'admin', 1, '0000-00-00 00:00:00'),
(15, 'Mrs. Sanjana Joshi', 'x010/x010/x010', 'FCSA', 'A39', 'Asst. professor', 'X010', 'X010', 'X010', 'MCA', 'x', 'x', 'x', 'x', '', '', '', 'admin', 0, '0000-00-00 00:00:00'),
(16, 'Mr. Ankush Joshi', 'x010/x010/x010', 'FTCA', 'A41', 'Asst. Professor', 'X010', 'X010', 'X010', 'MCA', 'x', 'x', '16.jpg', '16.doc', 'I am currently working as Asst. Professor at Faculty of Computer Science & Applications, Amrapali Group of Institutes, Haldwani. I have been awarded degree of MCA and M.Tech ( CSE) from Uttarakhand Technical University, Dehradun. I am having academic experience of more than 7 years with BCA and MCA programme. My specialization includes JAVA (Core), DBMS, Operating Systems. I have 4 research publications in several International Journals and have attended various seminars and technical workshops in the field of Computer Science & Applications.', 'ankushjoshi1987@gmail.com', '9627458333', 'dirmca', 1, '0000-00-00 00:00:00'),
(18, 'Dr. Rajendra   Belwal ', 'x010/x010/x010', 'FTCA', 'A01', 'Professor', 'x', 'x', 'x', 'Ph.D ( Physics)', 'x', 'x', '18.jpg', 'x', '39 year of teaching  experience. Was HOD in Kumaon University.', 'r_belwal@rediffmail.com', '9411197507', 'diraits', 1, '0000-00-00 00:00:00'),
(23, 'Dr. Jyoti    Singh', 'x010/x010/x010', 'FTS', 'B2', 'Associate Professor', 'x', 'x', 'x', 'Ph.D (Chemistry)', 'x', 'x', '23.jpg', '23.docx', 'Have 19 years teaching experience. Have also done CSIR and UGC projects. Worked as  Lecturer in Department of Chemistry, APS University, Rewa. Have published 55 research papers in International and National Journals.', 'jyotisingh.dtu@gmail.com', '9837377366', 'diraits', 0, '0000-00-00 00:00:00'),
(24, 'Dr. Ajay   Pali', 'x010/x010/x010', 'FTS', 'B3', 'Associate Professor', 'x', 'x', 'x', 'M.Sc.; Ph. D.', 'x', 'x', '24.JPG', 'x', 'An Associate professor in the Department of Applied Sciences. Specialized in Engineering Chemistry. This is a culmination of my intense involvement with Chemistry, which I have been passionate about since my childhood. My long stay in academics has been enriched by a previous short stint in manufacturing industries, which has helped me better link chemistry, as taught in class, with the actual world, for the benefit of my students. As an academic, apart from classroom teaching I have been involved in various tasks related to academic administration, which has led to enhancement of my skill set and my being able to contribute to the development of the organization.', 'drajaypali@gmail.com', '919837269', 'diraits', 0, '0000-00-00 00:00:00'),
(25, 'Dr. Vandana  Bisht', 'x010/x010/x010', 'FTCA', 'A23', 'Associate Professor', 'x', 'x', 'x', 'M.Sc.(Mathematics), Ph. D., B.Ed.', 'x', 'x', '25.jpg', 'x', 'Have 7 years of experience in teaching. Specialized in computational fluid dynamics and applied mathematics. Published 12 research papers in National and International Journals. ', 'vandanabisht7@gmail.com', '8954551199', 'diraits', 1, '0000-00-00 00:00:00'),
(26, 'Dr. Satyajit Sen Purkayastha', 'x010/x010/x010', 'FTCA', 'A12', 'Associate Professor', 'x', 'x', 'x', 'BE, M.Tech, PhD', 'x', 'x', '26.jpg', 'x', '\"As an academician, I have learnt that the best way to achieve success is to channelize all the resources towards specific goals and objectives and a good teacher is one who is open for incessant learning. \r\nA management belief that I strictly rely on is based on the fact that integrity, quality, service, positive attitude, aptitude for strategic thought and planning, along with the ability to adapt quickly to new ideas and situations allows any individual to achieve consistent and significant success in multiple domains.\r\nMy character and personality sketch is as follows: \r\n•A confident, self driven individual who reacts quickly to change.\r\n•A self-starter with a strong sense of urgency, who responds positively to new challenges and pressure situations.\r\n•A fast learner as well as a practical and ingenuous problem solver.\r\n•A fluent and articulate communicator, flexible and responsive. A self directed, goal oriented doer.\r\nTechnical Papers: 10 ', 'satyajitsenpurkayastha@gmail.com', '8449840035', 'diraits', 0, '0000-00-00 00:00:00'),
(28, 'Mr Debashis   Ghosh', 'x010/x010/x010', 'FTCA', 'A13', 'Associate Professor', 'x', 'x', 'x', 'x', 'x', 'x', 'x', 'x', '', '', '', 'admin', 1, '0000-00-00 00:00:00'),
(29, 'Mr Praveen  Saini', 'x010/x010/x010', 'FTS', 'B9', 'Associate Professor', 'x', 'x', 'x', 'M.Tech(CSE), MCP, CCNA', 'x', 'x', '29.png', 'x', 'He is a motivated and creative individual, with 12 years  of experience within education. He has done masters in Computer Science & Engineering. He has also done online Certification CCNA & MCP. He has specialization in Unix Operating System, System Administration, Advance Java, Compiler Design, Operating System, Data Communication & Networks etc. Apart from teaching He has skills to manage and maintain the IT services.', 'parveen24.saini@gmail.com', '9639377139', 'diraits', 0, '0000-00-00 00:00:00'),
