(122, 'Prof.(Dr.) Ritvik Dubey ', 'x010/x010/x010', 'FCBM', 'A1', ' Director', 'X010', 'X010', 'X010', 'MMS,PhD,BBA,UGC NET(Management)', 'x', 'x', '122.png', '122.doc', '\r\nDr. Ritvik Dubey is  an astute scholar and administrator having more than 14 years of teaching,administrative and research experience.Currently he is working as Professor(Director) at Amrapali Group of Institutes, Haldwani. \r\nHe has conducted many workshops,seminars,study trips and conferences.\r\nDuring his academic career he has published more than 5 papers in national/ international journals and participated more than 10 National Seminar/Conferences.\r\nHe is alumni of prestigious Universities of Allahabad and Lucknow.\r\n', 'ritvikdubey@gmail.com', '8126096191', 'dirmba', 1, '0000-00-00 00:00:00'),
(123, 'Dr. P. K.Shah', 'x010/x010/x010', 'FCBM', 'A2', 'Professor', 'X010', 'X010', 'X010', 'PhD,LLB,MBA,MA M.Com,B.Com', 'x', 'x', '123.jpg', '123.pdf', 'Dr. P.K.Shah  is having more than 26 years of experience as an academician. Currently he is working as Professor at Amrapali Group of Institutes, Haldwani. Three PhD scholars have recently awarded their degree from UTU Dehradun and 3 more scholars are presently pursuing their PhD under his guidance. During his academic career he has presented more than 6 research papers in international conferences and seminars. He has published 15 papers in national/ international journals and attended more than 35 National Seminar organized by different Universities & Govt. colleges of the Northern states of India in different issues.', 'shahpkumar@gmail.com', '9568222007', 'dirmba', 1, '0000-00-00 00:00:00'),
(124, 'Prof.(Dr.) Siddhartha Sharma ', 'x010/x010/x010', 'FCBM', 'A3', 'Professor', 'X010', 'X010', 'X010', 'PhD, MBA, MA, BBA', 'x', 'x', '124.JPG', '124.docx', 'Dr. Siddhartha Sharma is having more than 8 years of experience as an academician. Currently he is working as Deputy Director – Training & Placements at Amrapali Group of Institutes, Haldwani.\r\nHe is Charismatic and energetic administrator experienced in developing organizational strategies that build strong teams and cultivate positive environments. Multifaceted experiences in the areas of Training & Placements, Teaching & Learning and Academic Planning & Implementation.\r\n', 'dfwsiddhartha@gmail.com', '7409758958', 'dirmba', 1, '0000-00-00 00:00:00'),
(125, 'Dr. Deep Chandra', 'x010/x010/x010', 'FCBM', 'A4', 'Associate Professor', 'X010', 'X010', 'X010', 'M.Sc. , MBA ', 'x', 'x', '125.jpg', '125.pdf', 'Deep Chandra is an experienced banker turned academician, retired as Vice President from Nainital Bank Ltd, after serving the Bank for 33years .Currently working with Amrapali Group Of Institutes, Haldwani as Associate Professor. Exhibited ability of people management, business development and public relations  throughout the service tenure with this ability and experience imparting practical knowledge to the students of management. He is Ph.D. (Management) pursuing, MBA with specialization in finance, M.Sc. (statistics), CAIIB.', 'deep_chandra56@yahoo.co.in', '9568745333', 'dirmba', 1, '0000-00-00 00:00:00'),
(126, 'Dr. A. K. Srivastava', 'x010/x010/x010', 'FCBM', 'A5', 'Associate Professor', 'X010', 'X010', 'X010', 'MA. (Eco.), M.COM, PhD', 'x', 'x', 'sample.jpg', '126.docx', 'Dr. A.K.Srivastava have ninteen year of teaching experience in different institutes.\r\n', 'drsrivastavaanand@gmail.com', '9452536637', 'dirmba', 1, '0000-00-00 00:00:00'),
(127, 'Dr. Deepika S. Joshi', 'x010/x010/x010', 'FCBM', 'A6', 'Associate Professor', 'X010', 'X010', 'X010', 'MCA,MBA,Ph.D', 'x', 'x', '127.jpg', '127.docx', '\"Dr. Deepika S. Joshi is an accomplished educator with monstrated ability to teach, motivate, and direct students while maintaining high interest and achievement. Offering sterling experience of 18+\r\nyears, of which 16+ years have been in the field of academics. She is Ph.D. (Management), MCA, MBA with specialization in HR. Presently, designated as an Associate Professor (Faculty of Commerce & Business Management) at Amrapali Group of Institutes, Haldwani, Uttarakhand.\"\r\n', 'dsagta@gmail.com', '9899882346', 'dirmba', 1, '0000-00-00 00:00:00'),
(128, 'Dr. Garima Jaiswal Chandra', 'x010/x010/x010', 'FCBM', 'A7', 'Asst. Professor', 'X010', 'X010', 'X010', 'MBA , NET, USET, PhD', 'x', 'x', '128.JPG', '128.doc', '\"Dr. Garima Jaiswal Chandra is an Assistant professor in the areas of Finance and General Management with more than 12 years of experience in academics. She is UGC-Net, USET qualified in Management and currently pursuing MCom. \r\nDuring her career as a management teacher, she has conducted FDPs , Seminar and been a resource person for training programmes conducted for the Ministry of MSME. During her academic career she has presented several research papers in national and international conferences. Her published work includes research papers in national and international journals. Her research interest includes the study of venture capital, security market, and financial management. \r\n\"\r\n', 'garimain2001@gmail.com', '9410166600', 'dirmba', 0, '0000-00-00 00:00:00'),
(130, 'Dr. Gaurav Pant ', 'x010/x010/x010', 'FCBM', 'A9', 'Asst. Professor', 'X010', 'X010', 'X010', 'M.Com; MBA; M.Phil (Commerce);Ph.D; UGC NET (Commerce, Management); USET (Commerce); CWA (inter); PGDHRM;', 'x', 'x', '130.jpg', '130.docx', 'Dr. Gaurav Pant is Working as a Assistant Professor in Faculty of Commerce and Business Management since Feburary 2013, before joining the institute he had worked as a Assistant Manager (Financial Services) in a Sec. 25 Company formed by UGVS to implement IFAD and Uttarakhand Government funded project. Interest areas are Accounting and Finance.\r\n', 'gauravugc2012@gmail.com', '8477999577', 'dirmba', 1, '0000-00-00 00:00:00'),
(131, 'Dr. Hem Chandra Kothari ', 'x010/x010/x010', 'FCBM', 'B10', 'Asst. Professor', 'X010', 'X010', 'X010', 'M.Com., MBA (Finance), PGDBEF, NET (Commerce), SET(Commerce), Ph.D.', 'x', 'x', '131.jpg', '131.doc', 'Dr. Hem Chandra Kothari is a Highly motivated academician with specialisation in Accounting and Finance. He hold masters (M.Com.)  and Ph. D. in Commerce. His  research area of interest is Financial Econometrics, Stock Market Behaviour, and Entrepreneurship. He have got sixteen research papers published in National and International Journals of repute. He have attended ten national and international conferences, three FDPs on entrepreneurship, one FDP on Finance and two workshops on handling data in SPSS. He have been an Expert and co-convener in National and Inaternational Conferences.He also a paper setter of Uttaranchal University, Dehradun, Graphic Era University, Dehradun, and some other Universities.He have an experience to teach both UG and PG classes. Subjects in which he is specialized are; Financial Accounting, Financial Management, Management Accounting, Cost Accounting, Security Analysis and Portfolio Management, Entrepreneurship Development, Statistics for Management, Rese', 'hckothari33@gmail.com', '8958917291', 'nitin', 0, '0000-00-00 00:00:00'),
(132, 'Ms. Priyanka Dhingra', 'x010/x010/x010', 'FCBM', 'B11', 'Asst. Professor', 'X010', 'X010', 'X010', 'PhD,MBA,BBA', 'x', 'x', '132.jpg', '132.docx', 'Ms. Priyanka Dhingra is having more than 6 years experience as an Assistant Professor at Amrapali Group of Institutes.', 'priyankaasagi@gmail.com', '9897578208', 'dirmba', 1, '0000-00-00 00:00:00'),
