(134, 'Mr. Satyam Prakash Srivastava', 'x010/x010/x010', 'FCBM', 'B16', 'Asst. Professor ', 'X010', 'X010', 'X010', 'M.Com(H), MBA , NET,  Pursuing PhD', 'x', 'x', '134.jpg', '134.docx', 'Mr. Satyam Prakash Srivastava is working as Assistant Prof. in Faculty of Commerce & Business Manaement, Amrapali Group of Institutes, Haldwani.  Working experience of more than 8 years into academics since August 2009. Completed M.Com in June 2017, Pursuing P.hD from Uttarakhand Technical University, Dehradun. Presented research papers in National Seminars and published several papers in the areas of Financial Inclusion and Impact of Microfinance. Working as Exam Cell Coordinator since last 4 years in the department.\r\n', 'satyamprakash07@gmail.com', '7895685459', 'dirmba', 0, '0000-00-00 00:00:00'),
(135, 'Dr. Amanjeet Singh Sethi ', 'x010/x010/x010', 'FCBM', 'B13', 'Asst. Professor', 'X010', 'X010', 'X010', 'PhD(ManagemenT), MBA(Marketing), M.Com(Management), USET(Commerce), NET(Management), ', 'x', 'x', '135.jpg', '135.docx', '\"Dr. Amanjeet Singh Sethi is an Assistant professor in the areas of Marketing and General Management with more than 10 years of experience in academics. He is UGC-Net, USET qualified in Management and Commerce respectively. He has done his post graduation in Management and commerce groups.During his career as a management teacher, he has participated in several national and international FDPs, Seminar and been a resource person for training programmes. He is a visiting faculty in various programs of distance and open system of learning. His area of interest includes tourism, marketing, economics, general management among others. \"\r\n', 'amanjeetsinghsethi@gmail.com', '9837412525', 'dirmba', 1, '0000-00-00 00:00:00'),
