(152, 'Dr. Javed Aalam', 'x010/x010/x010', 'FTCA', 'A27', 'Asst. Professor', 'X010', 'X010', 'X010', 'MCA, Ph.D. pursuing', '2007', '-x-', '152.JPG', '152.doc', 'Javed Alam received B.Sc. (Hons) degree in Mathematics from Aligarh Muslim University, Aligarh, India and MCA (Master of Computer Applications) degree from Uttar Pradesh Technical University, Lucknow, India. He is GATE qualified and pursuing Ph.D in computer science. Presently he is an Assistant professor at Amrapali Institute of Management and Computer Applications, Haldwani, Nainital, India. He has contributed more than 6 research papers in International Journals. He presented and published more than 5 research papers in International and National Conferences. His research interest includes fuzzy logic, operation research (optimization techniques), computer programming and networking, intelligent transportation systems and simulation modeling in MATLAB.', 'javedalam4u@gmail.com', '9557592020', 'dirmca', 1, '0000-00-00 00:00:00'),
(153, 'Ms.Unzila Nawab', 'x010/x010/x010', 'FCBM', 'C24', 'Asst. Professor', 'X010', 'X010', 'X010', 'B.TECH , MBA', 'x', 'x', '153.png', '153.docx', 'Ms. Unzila Nawab is a proficient instructor as well as learner who enjoys working with her students and helping them reach for their dreams through their education. She believes an education should empower a person and help him or her make a positive contribution to our world.  She has done her B.Tech and MBA from Govind Ballabh Pant University of Agriculture & Technology. She has worked as a Management Trainee for one year. Presently, she is designated as an Assistant Professor in Faculty of Commerce & Business Management at Amrapali Group of Institutes, Haldwani, Uttarakhand.\r\n', 'unzilanawab@gmail.com', '7500724877', 'dirmba', 0, '0000-00-00 00:00:00'),
(154, 'Prof. (Dr.) Manoj Kumar Pandey', 'x010/x010/x010', 'FTCA', 'A0', 'Director', 'x', 'x', 'x', 'Ph. D.(Bio Fuel)', 'x', 'x', '154.jpg', 'x', 'Have 40 years of experience in industry and academics. Was responsible for turnkey execution of control and instrumentation of process industries. Was deputed to Malaysia to oversee site work at Malaysian power plant.', 'director.aits@amrapali.ac.in', '8872406878', 'diraits', 0, '0000-00-00 00:00:00'),
(155, 'Prof. (Dr.) S.K. Singh', 'x010/x010/x010', 'FHM', 'A0', 'Director', 'X010', 'X010', 'X010', 'DHM, MTM, Ph.D.', 'x', 'x', '79.jpg', 'x', 'Over 25 years of rich experience as an chef, operational manager in hospitality industry,educationist- managing educational Institute, planning institute growth, developing policies, strategizing, developing academic learning environment, and operations.\r\n\r\nHave been member of various advisory bodies of institutions, member of Board of Studies of universities actively involved in curriculum development, faculty development, student development, academic collaborations and corporate relationship development.', 'coo@amrapali.ac.in', '9837030794', 'diraihm', 1, '0000-00-00 00:00:00'),
(156, 'Prof. Prashant Sharma', 'x010/x010/x010', 'FHM', 'B1', 'Professor, Dean Academics', 'X010', 'X010', 'X010', 'DHMCT&AN, BA, MHM, MTM, UGC - NET', 'x', 'x', '80.jpg', '80.doc', 'A Hotelier with 18 years of rich operational and academic experience in Hotel management and operations ranging from concept building, menu designing, menu engineering, banqueting, guest interaction, crises management, training and development, human resource hiring and management. \r\nA member of Board of Studies of universities, actively involved in academic curriculum development, faculty development and corporate relationship development.\r\nAn alumni of Institute of Hotel Management Catering Technology & Applied Nutrition, Bangalore and worked with some most renowned organisations like the Oberoi Hotels and ITC Hotels with the experience of supervisory as well as management level. A Graduate in Hotel Management and Post Graduate in Hospitality Management and Tourism Management, cleared UGC – NET in Tourism Management and is currently pursuing PhD in the field related to Human resource issues in hospitality Industry.', 'psharma@amrapali.ac.in', '9927041565', 'dirAIHM', 1, '0000-00-00 00:00:00'),
