(511, 'Independence Day 2020', 'Wishing our students, alumni and well-wishers a very Happy Independence Day 2020. Following the Government Guidelines of Social Distancing the Independence Day Celebration was limited to the Flag Hoisting and singing of National Anthem only. The Tricolour was jointly unfurled by Mr. Narender Dhingra (Secretary), Dr. Sanjay Dhingra (CEO) and Mrs. Bindu Chawla (Tresurer) in presence of Prof. (Dr.) S. K. Singh (COO AIHM), Prof. (Dr.)  Manoj Pandey (Director AITS), Prof. (Dr.) Ritvik Dubey (Director', 1, '2020-08-21 06:03:19', ''),
(512, 'Republic Day', 'Following the Government Guidelines of Social Distancing the Republic Day Cebrations were limited to Flag Hoisting and the singing of the National Anthem. The Tricolour was jointly unfurled by Dr. Sanjay Dhingra (CEO) and Mrs. Bindu Chawla (Treasurer) in the presence of Prof. (Dr.) S. K. Singh (COO AIHM), Prof. (Dr.)  Manoj Pandey (Director AITS), Prof. (Dr.) Ritvik Dubey (Director FCBM), Prof. (Dr.) Garima Garg (Principal FPS), Prof. (Dr.) Siddhartha Sharma (Director CTPD), Prof. Prashant Sharm', 1, '2021-01-28 05:29:37', ''),
