(39, 'The Amrapali Institute of Hotel Management actively participated in Banarsidas Chandiwala Ensemble-2012', 'Students of Amrapali Institute of Hotel Management, Haldwani displayed great culinary skills at 11th Banarsidas Chandiwala Ensemble-2012. It was a National level culinary competition where teams from 37 different colleges from India and Abroad participated in the 3 day event. The budding chefs from Amrapali Institute of Hotel Management, Haldwani included Aryan Mathur, Shiksha Bajetha, Arshdeep Kaur, Vivek Bhatt, Kunal Kathpalia, Vineet Nanda and Atul Chaubey.', 'x', 'xpath', 'Arial', '19/10/2012', '2016-11-24', '2017-01-30', '10:49:22 AM', 1, 'admin'),
