(106, 'COLLAGE COMPETITION', 'A Collage Competition was held for the students of AIHM on 24th& 25th\r\nSeptember 2014.The theme of the competition was SUSTAINABLE\r\nDEVELOPMENT & COMMUNITY BASED TOURISM .\r\nAltogether twenty teams of two members per team participated in the\r\ncompetition and five teams were shortlisted on 24th September for the\r\nfinal round which was held on 25th September 2104.<br>\r\nThe winners of the competition were as follows:<br>\r\n<b>First Prize -</b> Tejwant Singh & Akshat Rawat<br>\r\n<b>First Runner Up -</b> Jaydeep Sharma & Nitesh Kumar Singh<br>\r\n<b>Second Runner Up -</b>  Navneet Singh & Chandu Bargali', 'x', 'xpath', 'Arial', '30/07/2014', '2016-11-24', '2017-01-30', '3:13:35 PM', 1, 'admin'),
(107, 'WORLD TOURISM DAY CELEBRATION', 'Amrapali Institute of Hotel Management took the initiative and decided\r\nto celebrate the WORLD TOURISM DAY in a slightly different manner\r\nwhich is related to the core Hotel Industry.<br>\r\nStudents of the Institute went to the Kathgodam Railway Station and\r\ngreeted the tourists with a flower and a welcome smile. Since it was\r\nnot expected by the tourists  as well as it had never happened in\r\nHaldwani ,so they were very happy to see the students welcoming them.<br>\r\nOn the other hand students were also excited after getting  warm\r\ngestures from the tourists. It was for the first time that students\r\nwere doing and experiencing what they had learnt over the years in the\r\ncollege.', 'x', 'xpath', 'Arial', '30/07/2014', '2016-11-24', '2017-01-30', '3:13:35 PM', 1, 'admin'),
(108, 'Financial Education Program Organized At FCBM', 'In order to give boost to the developmental process for the student one day workshop was organized by <b>Security Exchange Board of India</b> under its financial education program by SEBI resource person Mr. Manoj Bhatt on 10 October 2014, in <b>Faculty of Commerce and Business Management, AGI.</b>\r\n', 'x', 'xpath', 'Arial', '14/10/2014', '2016-11-24', '2017-01-30', '9:14:35 AM', 1, 'admin'),
(109, 'Poster and Collage making competition', 'The students participated in  Poster and Collage making competition  on 24th September , 2014 & the 5 team finalist of the first round competed on 25th September 2014 . The Posters made by these teams were taken and displayed at prominent places in Kathgodam Railway station to highlight the importance of World tourism Day .', 'x', 'xpath', '', '03/11/2014', '2016-11-24', '2017-01-30', '3:13:35 PM', 1, 'admin'),
