(113, 'Aptitude Training for MCA Final Year', 'Faculty of Computer Science & Applications has organized 40 hrs special training program for M.C.A. final year students on logical reasoning, quantitative aptitude, P.D.P. & Competitive English between 25-Nov-2014 to 02-Dec-2014. <br />\r\nThe training were immensely appreciated by the participants.', 'x', 'xpath', 'Arial', '08/12/2014', '2016-11-24', '2017-01-30', '9:38:34 AM', 1, 'admin'),
(114, 'Apptitude Training for MCA III Semester', 'Faculty of Computer Science & Applications has organized under C.E.C. a one Week special training on PDP/ Apptitude for MCA III Semester. The training is being conducted by <b><i>Ms. Chavi Bhutania</i></b> in first week of August, 2014. <br />\r\nThe sessions includes:<br /> \r\n- logical reasoning Sessions  <br />\r\n- Quantitative aptitude Sessions<br />\r\n- P.D.P. & Competitive English Sessions as per industry demands...\r\n', 'x', 'xpath', 'Arial', '11/12/2014', '2016-11-24', '2017-01-30', '9:56:52 AM', 1, 'admin'),
(115, 'Technical Sessions for MCA III Semester', 'Faculty of Computer Science & Applications has organized special technical training sessions on C, C++ & J2ME. <br />\r\nThe sessions had been organised under C.E.C in second week of August, 2014 by <b><i>Prof. Nitin Pandey & Prof. Nirmal Pandey</i></b> to enhance the programming skills in various disciplines.', 'x', 'xpath', 'Arial', '11/12/2014', '2016-11-24', '2017-01-30', '9:56:00 AM', 1, 'admin'),
(116, 'Workshop on Responsive Web for BCA Final Year', 'Faculty of Computer Science & Applications has organized a workshop for BCA final year students in september, 2014.\r\nThe sessions had been planned and conducted under three  phases: <i>viz.</i>: <br />\r\nPhase 1 - Designing Responsive Web<br />\r\nPhase 2 - Implementation of JQuery Mobile <br />\r\nPhase 3 - Implementation of light weighted database via mySQLi<br />\r\nPhase 4 - Implementation of server side programming for responsive web.<br />\r\nThe workshop was conducted under C.E.C. by <b><i>Prof. Nitin Deepak, Prof. Mukesh Joshi & Prof. Naveen Tewari</i></b>. to enhance the smart devices programming skills.\r\n\r\n', 'x', 'xpath', 'Arial', '11/12/2014', '2016-11-24', '2017-01-30', '9:54:07 AM', 1, 'x000000111111000'),
