(130, 'One Day Workshop on \"Programmable Logic Controllers\" on 23rd march 2015', 'Electrical & Electronics Engineering department , AITS  is organizing a one day workshop on the topic \"Programmable Logic Controllers\" on 23rd mar 2015. Expert for this WORKSHOP will be Mr. Lokesh \r\nPrajapati. Usage of PLA , present scenario and its future scope will be discussed in the session. \r\n<br><br>\r\nInterested Students  from the EEE & ECE can take part in this workshop.\r\n<br>\r\nCo-ordinator for this event will be Mr. Tanuj Bisht, Asst. Prof ,EEE Department.\r\n<br><br>\r\n<font color=\"red\"><b>Note: </b></font> There will be  NO Registration charges for this workshop.', 'x', 'xpath', 'Arial', '20/03/2015', '2016-11-24', '2017-01-30', '3:45:39 PM', 1, 'admin'),
