(140, 'Achievements of AITS in INVERTIA-2015', 'Amrapali Group of Institutes, Haldwani took an active part in the INVERTIA 2015. Two Teams from different departments one from Amrapali Institute of Hotel Management and the other one from Amrapali Institute of technology and sciences were send to Invertia 2015.', 'x', '140.pdf', 'Arial', '16/04/2015', '2016-11-24', '2017-01-30', '12:10: 15 PM', 1, 'admin'),
