(142, 'Workshop was organised By Faculty of Computer Science &amp; Applications', 'Amrapali Group of Institutes firmly believes that in today’s scenario practical exposure plays a vital role along with conceptual knowledge in the overall development of students. Keeping this view in mind a workshop was conducted by Faculty of Computer Science and Applications for BCA final year students. ', 'x', '142.pdf', 'Arial', '29/04/2015', '2016-11-24', '2017-01-30', '02:41:25 PM', 1, 'admin'),
