(146, 'Faculty of Computer Science & Applications conducted a social activity \"Chetna\"', 'A social activity was conducted by Chetna Club  under the supervision of club coordinator Ms. Neelima Budhani. The students of Computer Science and Applications collected  surplus stationary items from students and these items were distributed to needy children at  Primary School, Lamachaur. The School administration appreciated this noble step taken by students of AGI.', 'x', '146.pdf', 'Arial', '23/05/2015', '2016-11-24', '2017-01-30', '01:39:00 PM', 1, 'admin'),
