(149, 'Department of Electrical and Electronics Engineering pay homage to Late president Dr. A. P. J. Abdul Kalam', 'On 13th Aug 2015, the students of EEE organised a quiz competition to pay homage to Late president Dr. A. P. J. Abdul Kalam. The ceremony was  graced by eminent teachers ', 'x', '149.pdf', 'Arial', '14/08/2015', '2016-11-24', '2017-01-30', '08:56:00 AM', 1, 'admin'),
