(177, 'AGI Student activity club', 'Student activity club of AITS organized an interdepartmental poster making competition on 11th Nov under two category, digital and hand made posters,  in which 32 teams participated from different colleges of AGI group.\r\n<br>\r\nVandana Pathak of B.Tech, CSE 1st year stood 1st and Ajay Rawat of BCA 3rd year stood 2nd under digital poster\'s category. Chandra Dangwal of\r\n BCA 1st year stood 1st and Kamal Bisht B.Tech, ME3rd year stood 2nd in Hand made poster\'s category.', 'x', '177.pdf', 'Arial', '22/11/2017', '2017-11-24', '2018-01-30', '12:08:07pm', 1, 'nitin'),
(178, 'Faculty of Computer Science and Applications organized a departmental level \"Cricket Tournament\".', 'Faculty computer science organized a departmental cricket tournament to encourage and develop overall persona of the students.Winning team Panthers (BCA 5th B) was awarded with Winning Trophy.', 'x', '178.pdf', 'Arial', '28/11/2017', '2017-11-28', '2017-12-01', '04:42:58pm', 1, 'dirmca'),
(179, 'Career Opportunities in the Armed Forces', 'Amrapali Institutes of Technology & Sciences organized an  Expert Session on\r\nopportunities in the Armed Forces.This session was held under the Alumni Connect\r\nProgramme on 09th December, 2017 in AITS conference Hall. This session was addressed \r\nby Flying Officer(Indian Air Force) Neha Melkani.She is the alumunus of Department of \r\nElectronics and Communication Engineering of 2012 batch.She had also worked in IT \r\ngiants Wipro and Infosys.\r\n\r\nShe briefed the students,of various departments of AITS, about how they can prepare\r\n for interview and join\r\nArmed Forces and plan for a better carrier in Armed Forces.\r\nShe told about the life in Indian Air Force and various oppourtunites provided\r\nby the IAF.Students felt very motivated after this expert session. \r\n\r\nOur guest Neha Melkani was presented a bouquet by Director AITS and a momento by \r\nthe Dean of AITS.\r\n', 'x', '179.docx', 'Arial', '13/12/2017', '2017-12-13', '2018-01-15', '03:23:05pm', 1, 'diraits'),
(180, 'INDUSTRIAL VISIT - BBA I year students ', 'Industrial visits are a value-added learning method for management students. Learning from textbooks, lectures and other study material does not suffice for holistic learning. Practical, hands-on learning is essential for better understanding of work processes and business functions.\r\nSo, to give students a practical exposure, an industrial visit to Parle Agro Pvt Ltd, SIDCUL, Pantnagar was organised for BBA I year students by FCBM, Amrapali Group of Institutes.', 'x', '180.docx', 'Arial', '16/12/2017', '2017-12-16', '2017-12-31', '11:49:04am', 1, 'dirmba'),
(181, 'INDUSTRIAL VISIT - TATA Motors Ltd, SIDCUL', 'Industrial visits are an effort to bridge the gap between classroom learning and practical exposure.To help students gain first-hand information regarding functioning of the industry, one such industrial visit to TATA Motors Ltd, SIDCUL, Pantnagar was organised for MBA I year students by FCBM, Amrapali Group of Institutes.', 'x', '181.docx', 'Arial', '06/02/2018', '2017-12-27', '2018-01-10', '08:56:19pm', 1, 'dirmba'),
(182, 'FACULTY DEVELOPMENT PROGRAMME', 'A Faculty Development Programme (FDP) was conducted in FCBM on 27th of January, 2018 by Dr (Prof) Ritvik Dubey, Director, FCBM.', 'x', '182.docx', 'Arial', '06/02/2018', '2018-02-06', '2018-02-28', '09:55:25am', 1, 'dirmba'),
(183, 'SARAS TRADE FAIR Visit by FCBM students', 'The Saras Trade fair was a 10 days fair which was inaugurated by ex CM Shri Bhagat Singh Koshiyari and Society Welfare Minister Shri Yashpal Arya. The trade was organised on the grounds of MB Inter College, Haldwani. The main purpose for organising this trade was to recognise local products and promote rural development, especially local women. It was a business extravaganza organised to provide market to local products and handicrafts.\r\nThe stude', 'x', '183.docx', 'Arial', '15/03/2018', '2018-02-13', '2018-03-31', '09:52:29am', 0, 'dirmba'),
(184, 'Management Games- Activity Based Learning', '\"What we learn with pleasure we never forget\"- with the same motive Faculty of Commerce & Business Management conducted a workshop on February 15, 2018 for all the AGI students to inculcate the art of management. The aim of the workshop was to make students understand the various Managerial concepts through fun activities arranged by revered faculties of FCBM.', 'x', '184.docx', 'Arial', '15/03/2018', '2018-02-17', '2018-03-31', '09:49:37am', 1, 'dirmba'),
(185, 'ABHYUDAYA 2018', 'Abhyudaya 2018 came forth as a package of competition, education and enthusiasm with twenty three teams from various Hotel Management Institutes across the country competing to showcase their best. The two days event on 20th and 21st February 2018 envisaged a multitude of activities. The competition means a lot to the enthusiasts as talent speaks voluminously through participation.', 'x', '185.docx', 'Arial', '07/03/2018', '2018-03-07', '2018-09-30', '03:21:26pm', 1, 'dirAIHM'),
(186, 'Marketing Club Activity - ADMAD SHOW was organized by FCBM on Date: 08-03-2018', 'The Marketing club of FCBM, AGI aims to instil marketing knowledge in students in the most fun and engaging way. The club constantly tries to give aspiring marketers of AGI the best learning exposure by organizing several quizzes and contests, live tasks & projects. \r\nAn ‘ADVERTISEMENT & PRODUCT TRIVIA’ was conducted by the ‘Marketing Club- FCBM’ under the guidance of Mr Manish Upreti, marketing club coordinator on Thursday, 8 March 2018. ', 'x', '186.pdf', 'Arial', '13/03/2018', '2018-03-13', '2018-03-31', '09:33:49am', 1, 'dirmba'),
(187, 'Workshop on “CHOOSING A CAREER”  organised by Faculty of Commerce & Business Management on Date: 12-03-2018', 'FCBM department hosted a workshop for their final year students on Monday, 12th of March, 2018. The session was addressed by keynote speakers, Dr DEVASHISH FULORIA, an alumnus of IIT Kanpur and PhD from Imperial college of London with work experience from content writing on Entrepreneurship and Mr ANKUR MAHAJAN, an alumnus of IIM Kozhikodi and centre director of T.I.M.E, Haldwani.', 'x', '187.pdf', 'Arial', '13/03/2018', '2018-03-13', '2018-04-30', '01:09:42pm', 1, 'dirmba'),
(188, '\"PREETI INDUSTRIES” visited by MBA 2nd semester', 'MBA 2nd semester students of Faculty of Commerce & Business Management were taken on an industrial visit to \"PREETI INDUSTRIES”, Lamachaur on Tuesday, 13th of March. Preeti Industries is a small company which produces non-woven polybags. ', 'x', '188.pdf', 'Arial', '17/03/2018', '2018-03-17', '2018-04-30', '03:11:48pm', 1, 'dirmba'),
(189, 'Faculty of Computer Sc.& Applications organised their annual tech fest \"IMPULSE 2018\"', 'Faculty of Computer Sc.& Applications organised their annual Tech fest \"IMPULSE 2018\" on dated 17th march, 2017. More than 20 universities and Institutes participated in this event with around 150 participants. The objective of the event was to provide a platform for all the aspiring technocrats to showcase their technical expertise and creative thinking in the field of computer and information technology. ', 'x', '189.doc', 'Arial', '09/04/2018', '2018-03-27', '2018-06-30', '07:34:32pm', 1, 'DIRMCA'),
