(208, 'Faculty of Commerce & Business Management - Live Project at Big Bazar', 'Practical Knowledge and Industry Exposure plays a vital role in shaping the Career Path of students. In keeping with this ideal, Faculty of Commerce and Business Management at Amrapali Group of Institutes continuously arrange live projects for students in reputed organizations every year.', 'x', '208.docx', 'Arial', '23/10/2019', '2019-10-23', '2020-03-31', '04:18:20pm', 1, 'dirmba'),
