(221, 'SANDHAAN 2020: AN ANNUAL TECH FEST', 'Sandhaan 2020 an annual tech fest will be organized by Faculty of Technology and sciences. <a href=\"https://www.amrapali.ac.in/sandhaan\">Click for Detail</a>', 'x', 'x', 'Arial', '11/03/2020', '2020-03-11', '2020-04-04', '02:22:32pm', 1, 'admin'),
(222, 'Industrial Visit for B. Com (Hons) 2nd Semester at SPNG, Kashipur.', 'On 15th February 2020 Faculty of Commerce and Business Management, AGI organized an Industrial Visit for B. Com (Hons) 2nd Semester at SPNG, Kashipur.\r\nStudents alongwith faculty members visited the Textile Mill. Executive Director Mr. P. K. Singh, Finance Manager Mr. Siddiqui and Personnel Manager Mr. Kerath Singh and Mr. Kishore Bisht shared their domain knowledge with the students.\r\n', 'x', '222.docx', 'Arial', '13/03/2020', '2020-03-13', '2020-06-30', '02:25:48pm', 1, 'dirmba'),
(223, 'WORKSHOP ON DERIVATIVE RESEARCH FOR FCBM STUDENTS', 'Faculty of Commerce and Business Management, AMRAPALI GROUP OF INSTITUTES organized a workshop on “Derivatives Research” for the students of B.Com (H), BBA and MBA on 3rd  to 4th February 2020. The experts were RITESH CHAVAN & JAY SAVLA- Co founders of Alpha Derivatives. It provided insights for analysing bullish and bearish market trends in open interest scenario.', 'x', '223.docx', 'Arial', '16/03/2020', '2020-03-16', '2020-07-31', '10:23:34am', 1, 'dirmba'),
(224, 'WORKSHOP ON INVESTMENT BANKING FOR FCBM STUDENTS', 'Faculty of Commerce and Business Management, AMRAPALI GROUP OF INSTITUTES organized a workshop on “INVESTMENT BANKING” for the students of B.Com (H), BBA and MBA on 5th to 6th February 2020. The Experts were CHETAN PATEL founder & CEO Money Works. Various investment options were deliberated in the Workshop and the exercise on fund management in equity research for optimizing performance of portfolio had been a great', 'x', '224.docx', 'Arial', '16/03/2020', '2020-03-16', '2020-07-31', '10:25:49am', 1, 'dirmba'),
(225, 'AVAHAN-2020', 'AVAHAN has been postponed due to safety precautions in view of Corana Virus COVID-19.', 'x', 'x', 'Arial', '16/03/2020', '2020-03-16', '2020-03-31', '10:30:29am', 1, 'diraihm'),
(226, 'Precautions against COVID-19 virus, FHM', 'Classes and other activities are suspended in FHM till further notice, as a safety precautions in view of COVID 19 virus threat. We request you all to get connected for regular online academic activities.\r\nDo take a good care of yourself.', 'x', 'x', 'Arial', '19/05/2020', '2020-03-29', '2020-05-31', '01:36:38pm', 1, 'diraihm'),
(227, 'INDUSTRIAL VISIT: EMAMI LIMITED', 'MBA 1st semester students of FCBM were taken on an industrial visit to \"EMAMI LIMITED”, PANTNAGAR on Monday, 25th of November 2020. <br>\r\nOn 15th February 2020 Faculty of Commerce and Business Management, AGI organized an Industrial Visit for B. Com (Hons) 2nd Semester at SPNG, Kashipur.', 'x', 'x', 'Arial', '19/05/2020', '2020-05-19', '2020-12-01', '07:55:47am', 1, 'dirmba'),
(228, 'WORKSHOP ON INVESTMENT BANKING FOR FCBM STUDENTS', 'Faculty of Commerce and Business Management, AMRAPALI GROUP OF INSTITUTES organized a workshop on “INVESTMENT BANKING” for the students of B.Com (H), BBA and MBA on 5th to 6th February 2020.The Experts were CHETAN PATEL founder & CEO Money Works.', 'x', 'x', 'Arial', '19/05/2020', '2020-05-19', '2020-12-01', '07:56:31am', 0, 'dirmba'),
(230, 'THEME IN VOGUE: PUNJABI THEMED LUNCH SESSION FOR STUDENTS', 'The Food Production Department at FHM, Haldwani went miles to invite Chef Sidakpreet Singh for a visit to the Institute to organize a workshop and inspire the students to go for a Punjabi Themed Lunch.\r\nA quirky innovative ambience with the Punjabi dishes like Butter Chicken, Paneer Makhani, Pindi Channa, Sarsoo Ka Saag, Makki Ki Roti, Jaggery and the Punjabi Kadhi and loads of knowledge through a workshop.\r\n', 'x', 'x', 'Arial', '19/05/2020', '2020-05-19', '2021-03-31', '12:59:53pm', 1, 'dirAIHM'),
(231, 'CAKE MIXING CEREMONY AT FHM', 'The Christmas preparation begins at FHM with the cake mixing ceremony. It was almost a month to celebrate Christ’s birth and FHM was again ready with the raisins, brandy, rum and ingredients that make the cake taste \'Christmas\', the ground floor restaurant once again became a sociable platform for Christmas fervour. A large gathering of management, faculty and students went crazy with mixing the cake for its eventful happening after sometime. ', 'x', 'x', 'Arial', '19/05/2020', '2020-05-19', '2020-12-31', '01:04:29pm', 1, 'dirAIHM'),
(233, 'INDUSTRIAL VISIT TO \"TARANGI”- A LUXURY RESORT AT RAMNAGAR', 'Industrial visits are always an effort to link the gap between classroom learning and practical exposure. They are aimed to impart practical knowledge to help students gain realistic information regarding functioning of the Hospitality Industry. Students of AIHM were taken on an industrial visit to \"Tarangi Resort”, RAMNAGAR in February, 2020. Tarangi is the leading and fastest growing properties in Uttarakhand at Corbett National Park, Ramnagar.', 'x', 'x', 'Arial', '19/05/2020', '2020-05-19', '2021-03-31', '01:16:20pm', 1, 'dirAIHM'),
(234, 'THE HOTELIERS \'FEST 2020, ABHYUDAYA ', 'Under the garden of talent nurtures the crop of efforts as 15th Abhyudaya 2020 the National Hospitality Talent Hunt witnessed the success.\r\nThe two days long Fest brought multicultural approach to the Institute gearing sharing and learning experiences through the Mentors and coordinators. \r\n\r\n', 'x', 'x', 'Arial', '19/05/2020', '2020-05-19', '2021-02-28', '01:26:29pm', 1, 'dirAIHM'),
(235, 'HOLI DARBAR 2020', 'A day that follows no rules and describes fun!!! It is festive time in Amrapali Group of Institutes and AIHM stands high in its contributions. Holi Darbar is an event organized by the students and faculty of AIHM as a part of the learning through practical applicability. Holi Darbar was decorated in the \'Retro style\' with posters of olden days to the present day Bollywood actor and actress. ', 'x', 'x', 'Arial', '19/05/2020', '2020-05-19', '2021-03-31', '01:29:11pm', 1, 'dirAIHM'),
(236, 'FHM at Amrapali Group of Institutes signs MOU’s with leading hospitality organisation worldwide.', 'At FHM we are seeking to improve the quality of our graduates and their employment prospects. Industry experts are invited to the institutions to help upgrade facilities and teach students, share their experience and train students on latest trends, as part of the initiative being overseen FHM has recently signed MOU’s with The Alpin Hotel (Romania), Marriot International, ITC group of hotels, Food Link Pan India, Lemon Tree & Aahar ways.', 'x', 'x', 'Arial', '01/06/2020', '2020-05-19', '2021-03-31', '01:05:23pm', 1, 'dirAIHM'),
(238, 'FTCA hosted IOT Workshop', 'Faculty of Technology & Sciences, AGI hosted One Day Workshop on IOT (Internet of Things) with Python was successfully organized by Faculty of Technology & Computer Applications on 14th-sep-2019.', 'x', 'x', 'Arial', '20/05/2020', '2020-05-20', '2020-09-30', '11:59:54am', 1, 'dirmca'),
(239, 'Lockdown: A time to showcase the talent', 'ASCAB –AIHM introduces a world of creativity during lockdown from Decoration Club & Future and Sharp Club as students do activities from home. The decoration Club students made creative wall hangings and painted pots to renovate their interiors. The Future & Sharp Club students indulged in making tasty shakes and mocktails too. The pearls are out of the oysters and there is an online competition held by the club members for all the AIHM students.', 'x', 'x', 'Arial', '22/05/2020', '2020-05-22', '2021-03-31', '12:07:10pm', 1, 'dirAIHM'),
(240, 'Mother’s Day Online Celebrations', 'Mother’s day came as a surprise from the co curriculum team as it instigated the students to make cards. There were 45 contestants presenting their love for their mother as beautiful drawings and sketches. The first position was secured by Deepak Bhatt, BHMCT 2nd Sem, second by Nishtha Khetwal, BHM KU 2nd Sem. while there was a tie for third position between Pramod Bhatt and Pramod Singh, BHM KU 2nd Sem. ', 'x', 'x', 'Arial', '22/05/2020', '2020-05-22', '2021-05-09', '12:08:15pm', 1, 'dirAIHM'),
(242, 'Faculty of Technology & Computer Applications at AGI celebrated the World Environment Day', 'Faculty of Technology & Computer Applications at Amrapali Group of Institutes celebrated the World Environment Day on 5th June 2020 with great zest and zeal . Due to covid 19 various activities were conducted online . Activities for the students to participate: painting, video message on  following :<br>\r\nSave trees, Save Water, Avoid pollution, Save animals, Grow plants for future, Save Earth\r\nSave energy. ', 'x', 'x', 'Arial', '05/06/2020', '2020-06-05', '2020-10-31', '01:55:05pm', 1, 'dirmca'),
(243, '1. IT’S THE GRIT THAT PREDOMINATES SKILL AT AIHM', 'The Departmental efforts supplied fuel to the hospitality students and encouraged them to ensure that skill needs no kitchen or workplace with elaborate arrangements. The students of F&B Production, F&B Service and HK Department came with beautiful ideas shooting videos to chisel their skills from home. These videos are already viral and gaining acknowledgement and popularity as encouragement. AIHM students make the difference in every situation.', 'x', 'x', 'Arial', '06/06/2020', '2020-06-06', '2021-03-31', '10:22:49am', 1, 'dirAIHM'),
(245, 'International Yoga Day', 'A picture exhibit of the combination of mind, body and soul through Yoga was exhibited by the Decoration Club students as a reverence to their motherland on Yoga Day. The students send forth the message of unity of the three planes of existence through their skills. The best way to pay reverence to the foresightedness presented as ancient heritage lies in the pictures and sketches. \r\nYoga for Health, Yoga from Home\r\n', 'x', 'x', 'Arial', '20/06/2020', '2020-06-20', '2021-03-31', '04:10:56pm', 1, 'dirAIHM'),
(277, '\'\'THE ONLINE BUDDING CHEF 2020\"', 'Amrapali Institute of Hotel Management has an amazing enterprise for foodies as the ‘ Take A Break’Snacks Making Competition. The competition opens its doors to all the viewers that love to take a challenge and wish to garnish their skills making the best use of lockdown. Be a part of the crisp and crunchy short delightskill test following all the rules and regulations. With best wishes AIHM, Haldwani. <a href=\"https://www.amrapali.ac.in/cooking-competition\">Click for detail...</a>', 'x', 'x', 'Arial', '11/07/2020', '2020-06-25', '2020-07-13', '11:48:05am', 1, 'dirAIHM'),
(278, 'Hold Infinity in the palm of your hand And Eternity in an hour- The Student Saga Continues as ASCAB-AIHM ACTIVITIES', 'The varied napkin folds by Future and Sharp Club through videos depicting Napkin Folds opens the Restaurant to the World. People who use these napkins will now take heed to the effort behind it.\r\nThe Ashmolean like exhibits, as we call them, are the judicious efforts of the students of Decoration Club as they transcend arty to skill with a message of a ‘Small Family’.\r\n', 'x', 'x', 'Arial', '11/07/2020', '2020-07-11', '2021-03-31', '11:53:52am', 1, 'dirAIHM'),
(279, 'Fortify positivity and insulate creativity- Slogan from ‘The Decoration Club-and the Future and Sharp Club-AIHM’', 'Hobby is the break that really helps to dig the ‘me in me’ helping to live life to the fullest. It is measurable with the creative mind.\r\nThe members of ‘Decoration Club and Future and Sharp Club’ are really becoming more agile and efficient company during the lock down. Their creativity to bring the Indo Western culture at sketch clubbed with the kind gesture of tea making by the members of ‘F & S Club’ are becoming prized treasures.', 'x', 'x', 'Arial', '11/08/2020', '2020-08-11', '2021-03-31', '11:46:23am', 1, 'dirAIHM'),
(281, 'AUGUST MEANS ‘INSPIRING REVERANCE OR ADMIRATION’ as AIHM celebrates Janmastami, Rakshabandhan and Independence Day in its own creative style.', 'Reverence and admiration are the words associated with August. Do you know that the month of August was once called Sexlitus meaning 6th and in 8 BC the month was named August after Augustus Caesar, the first Roman Emperor. We may call it coincidence or destiny but August is the month of Reverence and admiration in our institute as in our country.', 'x', 'x', 'Arial', '27/08/2020', '2020-08-27', '2021-04-30', '11:55:22am', 1, 'dirAIHM'),
(283, 'Teacher’s Day 2020 in loving memory of  Dr. Radhakrishnan', 'The ASCAB- AIHM run Decoration Club laid emphasis on the important role of teachers through a well thought activity under the guidance of their student coordinators. They organized an activity where students prepared cards of different types to express their gratitude towards their teachers. These cards were dispatched to the faculty members.', 'x', 'x', 'Arial', '22/09/2020', '2020-09-23', '2021-05-31', '01:16:59pm', 1, 'dirAIHM'),
(285, '‘Searching potential for legendry’- Club President with Members of Creativity Club....World Tourism Day. ', 'The wonderful creation by the members of the ‘Decoration Club’ also published as ‘Creativity Club’ of AIHM has sent ripples of wonderful vibes of artistic display throughout AIHM. The young armors of Tourism and Hospitality Industry created posters and banners depicting the ‘World Tourism Day.’ They were projections of the travelers’ instinct to raise our spirits, galvanize the fire and heighten our hopes.', 'x', 'x', 'Arial', '06/10/2020', '2020-10-06', '2021-09-06', '12:22:01pm', 1, 'dirAIHM'),
(286, 'Webinar on Housekeepers week', 'A webinar on the ‘Effect of COVID 19 on Housekeeping Practices’ was conducted by the Housekeeping Department on  October 2020, as a part of the International Housekeeper’s Week. Mr. Vinod Suhag, Regional Director of Housekeeping, Dubai, Mr Gaurav Gangola, Manager, Housekeeping, Seychelles and Mr. Pallav Anand, Executive Housekeeper, Ghaziabad provided thoughtful insights to the guests for the post pandemic New World requirements. ', 'x', 'x', 'Arial', '12/10/2020', '2020-10-12', '2021-03-12', '12:25:41pm', 1, 'dirAIHM'),
(288, 'Happy International chef day 2020', '‘HEALTHY FOOD FOR THE FUTURE’- A celebration of the initiation by Dr. Bill Gallagher, a renowned chef who created International Chefs Day in 2004.\r\nThe silver tint in the clouds of doubt is an opportunity to be harnessed and ‘Don’t Quit’ By John Greenleaf Whittier can be considered as the motivation at AIHM, Haldwani when it displayed it’s determination through International Chefs’ Day 2020.Food as Bhojan Thal and a webinar has been organised.', 'x', 'x', 'Arial', '22/10/2020', '2020-10-20', '2021-10-20', '10:10:52am', 1, 'dirAIHM'),
(289, 'AIHM Training & Placement cell', 'AIHM Training & Placement cell always concerns about its strong visionary objectives. We strives to provide the best possible training and placement opportunities to our students .Institute has succeeded in obtaining overwhelming response from various recruiters. Amidst many challenges in various fronts, about 90 plus percentage of students from different hospitality batches were able to receive placement in various reputed organizations.', 'x', 'x', 'Arial', '10/11/2020', '2020-11-10', '2021-03-31', '03:45:32pm', 1, 'dirAIHM'),
(290, 'Diwali celebration by Decoration Club AIHM', '. The COVID 19 phase has ultimate this art from creative hands and brought forth a new era of entertainment and hobby among the ‘Creative Club Members’ of the housekeeping department at AIHM, Haldwani. And- ‘as the sun went cold and pale as moon and festivities engaged men’, the club members crowned the festivities with their celebration of art in the form of artistic rangoli for Diwali wishing a happy and safe Diwali. ', 'x', 'x', 'Arial', '03/12/2020', '2020-12-03', '2021-05-31', '03:58:08pm', 1, 'dirAIHM'),
(291, 'Cake Mixing Ceremony at AIHM', 'A harbinger of good tidings and happiness the cake mixing ceremony was performed blithe fully with social distancing amidst COVID 19 at AIHM. \r\nThere is something very special about the AIHM Ground Floor Restaurant as it has witnessed many ceremonious occasions. Although cake mixing ceremony dates back to the 17th century in Europe its tradition continues at AIHM since its inception. ', 'x', 'x', 'Arial', '07/12/2020', '2020-12-07', '2021-10-07', '10:11:19am', 1, 'dirAIHM'),
(292, 'AVAHAN 2020 International Online Conference', '“Change is the end result of all true learning.” ― Leo Buscaglia\r\nThe 8th International Conference Avahan, the most influential hotel investment conference entitled, ‘Challenges Upfront and Future Prospective-Innovation, Entrepreneurship and Economic Policy’ was organized on 18th and 19th December through the online platform. It was an enticing, enriching learning with content-rich sessions and excellent networking platform. ', 'x', 'x', 'Arial', '19/12/2020', '2020-12-19', '2021-12-17', '03:52:02pm', 1, 'dirAIHM'),
(293, '5 Day Online FDP on Cyber Security', '5 Day Online Faculty Development Programme on Cyber Security organised by Faculty of Technology & Sciences under the aegis of TEQIP III Uttarakhand Technical University in the duration between 16th-Sep to 20th September 2020.', 'x', 'x', 'Arial', '28/12/2020', '2020-12-28', '2021-05-31', '03:01:57pm', 1, 'nitin'),
(294, '5 days FDP on Soft Computing', 'A 5 days FDP on Soft Computing with Uttarakhand Technical University Under TEQIP III, Organized\r\nby Faculty of Technology and Computer Applications during 2 September 2020 to 6 September\r\n2020', 'x', 'x', 'Arial', '28/12/2020', '2020-12-28', '2021-03-31', '03:02:44pm', 1, 'nitin'),
(295, 'And I make grape decisions!!!', 'An enriching experience was shared by Mr. Sanjay Singh Ranghar, Anantara Hotels and Resorts, Muscat Oman through a Knowledge Booster online session conducted by the F&B Department, AIHM, Haldwani. The ripe juicy grapes and wine tasting techniques dominated the session with an enthusiastic gathering of students.', 'x', 'x', 'Arial', '31/12/2020', '2020-12-31', '2021-12-31', '12:06:55pm', 1, 'dirAIHM'),
(296, 'Welcome gesture to the Year 2021.', 'On the occasion of X-mas & New Year it is all about spending time with family and & friends and sending greetings to loved ones staying far away and at AIHM the students celebrated this occasion by following social distancing yet the celebrations were at full swing.\r\nMembers of Decoration club under the umbrella of HK, AIHM made some beautiful decoration creations and shared with each other which were a welcome gesture to the Year 2021.', 'x', 'x', 'Arial', '12/01/2021', '2021-01-12', '2021-12-01', '12:31:40pm', 1, 'dirAIHM'),
(297, '5 Day Online Student Development Program on CATIA', 'Amrapali Institute of Technology and Sciences and Uttarakhand Technical University jointly organized a 5 Day Online Student Development Program on CATIA- Modelling & Design Excellence from 5th - 9thSeptember 2020 under the aegis of TEQIP-III.', 'x', 'x', 'Arial', '17/01/2021', '2021-01-16', '2021-02-28', '08:29:53am', 1, 'dirmca'),
(298, '5 Day Online FDP on Cyber Security', 'Amrapali Institute of Technology and Sciences (AITS) organises 5 Day Online Faculty Development Programme on Cyber Security under the aegis of TEQIP III Uttarakhand Technical University in the duration between 16th-Sep to 20th September 2020.\r\nFor the FDP we have got good response of faculty members, Research scholars from various parts of India including J&K , Punjab , Hariyana , Rajsthan , UP, Madhya Pradesh , Siikim , Asam , West Bengal , Karna', 'x', 'x', 'Arial', '17/01/2021', '2021-01-16', '2021-02-28', '08:29:12am', 1, 'dirmca'),
(299, '6 Day Online Student Development Program on Machine Learning', ' Amrapali Institute of Technology and Sciences and Uttarakhand Technical University jointly organized a 6 Day Online Student Development Program on Machine Learning from 10th - 15th December 2020 under TEQIPIII. The Experts for the Online Learning Program were Mr. Mohd. Rashid, Ms. Anchal Sharma and Mr. Nitin Chandola. Prof. (Dr.) M. K. Pandey, Director AITS warmly welcomed the Experts and the students to the Workshop during his Address.', 'x', 'x', 'Arial', '16/01/2021', '2021-01-16', '2021-03-29', '09:56:57am', 1, 'dirmca'),
(300, '5 days Online FDP on Soft Computing', ' Amrapali Institute of Technology and Sciences (AITS) organises a 5 days FDP on Soft Computing with Uttarakhand Technical University Under TEQIP III during 2 September 2020 to 6 September 2020 For the FDP we have got good response of faculty members , Research scholars from various parts of India including J&K , Punjab , Hariyana , Rajsthan , UP, Madhya Pradesh , Siikim and more...', 'x', 'x', 'Arial', '16/01/2021', '2021-01-16', '2021-03-24', '09:57:54am', 1, 'dirmca'),
(302, '‘Network opportunities, Social Opportunities, Professional Experience, Personal development, Leadership, Organizational and Management Skills’ ', '…And all this through AIHM Clubs.\r\nThe AIHM faculty and students have been long associating through clubs in a congenial environment. The close of 2020 and the entry of 2021 filled the remoteness through a large number of club activities by the Gourmet Club, Future and Sharp Club and Creativity Club through online sessions on Sous Vide, Molecular Gastronomy, Wine and Winery and Kite making activity and all this added warmth to the chill winters. \r\n', 'x', 'x', 'Arial', '21/01/2021', '2021-01-21', '2021-12-21', '02:56:14pm', 1, 'dirAIHM'),
(303, 'Interview – Fear turned to valor of knowledge and personality', 'The training and placement cell stationed at AIHM under the lead of Mr. Pawan Mehra organized an expert session on 16th January, 2021. This online session was delivered by Mr. Anurag Sharma founder of LFA Consulting LLP. Interview is a resultant of knowledge and skill. Skill improvement is a talent and Mr. Anurag Sharma helped students and faculty understand this talent.\r\n Learn and grow future hoteliers under the shade of AIHM Family Tree.\r\n', 'x', 'x', 'Arial', '21/01/2021', '2021-01-21', '2021-12-21', '02:57:33pm', 1, 'dirAIHM');
INSERT INTO `newsevents` (`ID`, `SUBJECT`, `NEWS`, `BLOG_URL`, `PATH_ATTACH`, `FONTJI`, `DATE_`, `DATE_START`, `DATE_END`, `TIME_`, `STATUS`, `USERNAME`) VALUES
(304, 'WEBINAR ON NEW PROPERTY COUNTDOWN, FHM', 'A Webinar was planned and successfully completed on 19th January 2021 by the Housekeeping department under the flagship of Amrapali Institute of Hotel Management, Haldwani. The topic for the Webinar was NEW PROPERTY COUNTDOWN –Housekeeping in Newly Made Hotels and the resource person for this Webinar was Mr. Gaurav Singh Gangola, Manager Housekeeping, Seychelles.', 'x', 'x', 'Arial', '21/01/2021', '2021-01-21', '2021-12-31', '02:58:30pm', 1, 'dirAIHM'),
(305, 'Webinar western cuisine, FHM', 'An online session was organized by the Culinary Department, AIHM on the 25th of January where Chef Sagar Rawat, a renowned cook at BOURY, Belgium introduced the young minds with thoughts on culinary challenges, recipe formulation and new evolving techniques. Chef Sagar Rawat’s style of delivery left a mark in the heart on every listener and students learnt in abundance.', 'x', 'x', 'Arial', '27/01/2021', '2021-01-27', '2021-12-31', '04:18:57pm', 1, 'DIRaihm'),
(307, 'INDUSTRIAL EXPOSURE TRAINING SUMMER BATCH ', '\"Training is the first step to shape your learning in the best form\"\r\nInterview sessions towards the summer batch are going in smooth and organized manner, through virtual platform.\r\nAll the best to budding professionals\r\n\r\nTraining and placement cell, FHM', 'x', 'x', 'Arial', '13/02/2021', '2021-02-13', '2021-05-31', '12:29:22pm', 1, 'dirAIHM'),
(308, 'Webinar on \" Investor Awareness: A Key To Financial Well- Being on 30th Dec.2020. ', 'The talk was delivered by Mr. Sanjay Kumar Agarwal, Head- CBSDC. He focused upon the various aspects & know-how of investments, Savings & Insurance,Goal setting. The webinar was quite wholesome, detailed and rendered to exact information that was required by the students at MBA level. The students were actively involved in the discussion and the whole session was very interactive. ', 'x', 'x', 'Arial', '01/03/2021', '2021-03-01', '2021-03-01', '10:17:11am', 1, 'dirmba'),
(309, 'WEBINAR ON - \"SCOPE OF DIGITAL MARKETING IN NEW ERA\"', '11 th Jan 2021| FCBM-AGI\r\nGuest speaker from industry Mr. Ajay Singh Bisht, Chief Marketing Officer, Affiliate Via Canada contributed his views on exploring career opportunities in digital marketing.  The speaker gave a complete overview of what digital marketing is all about and how can students enhance their digital marketing skills.  ', 'x', 'x', 'Arial', '01/03/2021', '2021-03-01', '2021-03-01', '10:22:14am', 1, 'dirmba'),
(310, 'Resume Writing Workshop', 'FCBM in Collaboration with T&P AGI,in its efforts to polish the Resume Writing Skills of MBA, BBA & BCH final year  students, organised a workshop from 4th to  6th February 2021 in the campus.  The workshop was conducted on the basic idea of  Resume Writing, Efficient Adaptation, Enhancement and Presentation. Dr Siddharth Sharma, Director- T&P enlightened the students with enormous knowledge on the respective subject matters.', 'x', 'x', 'Arial', '01/03/2021', '2021-03-01', '2021-03-01', '10:25:35am', 1, 'dirmba'),
(311, 'Webinar on Career & Job roles in Financial Services Industry', 'FCBM- AGI, organised a Live Webinar for students on \"Career and Job roles in Financial services Industry - A complete analysis.” on 2nd March 2021 at 10 am. \r\n\r\nThe Expert for the Session was Shri Aditya Gadge, Founder & CEO of AIWMI. \r\nThe attendees discussed about the Career Options and Job roles in Banking, Insurance, Mutual Funds, Alternative Investments,Family Office Investments, Financial Modelling, Pension funds, credit analysis etc.', 'x', 'x', 'Arial', '10/03/2021', '2021-03-10', '2021-03-10', '10:31:00am', 1, 'dirmba'),
(312, 'Webinar on International Marketing & Research', 'Faculty of Commerce and Business Management, AGI, organised a Live Webinar for students on \"International Marketing and Research” on February 19th 2021 between 10:00 am - 11:30 am.\r\n\r\nThe Expert for the Session  Mr. Subodh Sakpal, Associate Manager- AC Nielsen. \r\nexplained the concept of Marketing, its relevance in International Markets, loco-voco marketing, the research techniques & tools of marketing.', 'x', 'x', 'Arial', '10/03/2021', '2021-03-10', '2021-03-10', '10:36:24am', 1, 'dirmba'),
(313, 'Faculty of Commerce &amp; Business Management, Amrapali Group of Institutes organized a Webinar on &quot; Investor Awareness: A Key To Financial Well- Being on 30th Dec.2020.', 'Faculty of Commerce & Business Management, Amrapali Group of Institutes organized a Webinar on \" Investor Awareness: A Key To Financial Well- Being on 30th Dec.2020. The talk was delivered by Mr. Sanjay Kumar Agarwal, Head- CBSDC.\r\n \r\nHe focused upon the various aspects & know-how of investments, Savings & Insurance. Mr. Sanjay Kumar Agarwal gave very important insights about Goal setting, investment instruments, saving habits & investment decision', 'x', 'x', 'Arial', '26/03/2021', '2021-03-26', '2021-04-30', '11:03:48am', 1, 'dirmba'),
(314, 'WEBINAR ON - \"SCOPE OF DIGITAL MARKETING IN NEW ERA\" 11 Jan 2021', 'Webinar on \"SCOPE OF DIGITAL MARKETING IN NEW ERA\" was conducted by Faculty of Commerce & Business Management, Amrapali Group of Institutes, Haldwani. Guest speaker from industry Mr.Ajay Singh Bisht, Chief Marketing Officer, AffiliateVia Canada contributed his views on exploring career opportunities in digital marketing. \r\nThe speaker gave a complete overview of what digital marketing is all about and how can one enhance digital marketing skills.', 'x', 'x', 'Arial', '26/03/2021', '2021-03-26', '2021-05-26', '11:08:30am', 1, 'dirmba'),
(315, 'Resume Writing Workshop  4th to  6th February 2021', 'The Placement cell , Amrapali Group Of Institutes, Haldwani in its efforts to polish the Resume Writing Skills of MBA, BBA & BCH final year  students, organised a workshop. The workshop was conducted on the basic idea of  Resume Writing, Efficient Adaptation, Enhancement and Presentation.\r\nDr Siddharth Sharma, Director- Training & Placement enlightened the students with enormous knowledge on the respective subject matter.', 'x', 'x', 'Arial', '26/03/2021', '2021-03-26', '2021-05-26', '11:11:29am', 1, 'dirmba'),
(316, 'Covid-19 II Awareness Campaign', '<a href=\"https://amrapali.ac.in/covidawareness\" target=\"_blank\"><img src=\"https://amrapali.ac.in/assets/img/covid.jpg\" width=\"100%\"></a><br>\r\n<a href=\"https://www.amrapali.ac.in/photos_inner/513\" target=\"_blank\">Covid-19 Awareness Gallery</a>', 'x', 'x', 'Arial', '19/04/2021', '2021-04-19', '2021-05-30', '12:36:36pm', 1, 'nitin');
